INSERT INTO `articles` VALUES (2,'Работа с консолью','Работа с консолью','Работа с консолью','',2,'\np(#toc).  \n\nДля того чтобы писать приложения на **C#** совсем не обязательно скачивать тяжеловесную **Visual Studio 2010**, вполне хватит и **Express** версии, которая является бесплатной (в том числе и для коммерческой разработки) весит в 6 раз меньше и отличается от полноценной студии лишь отсутствием некоторых встроенных инструментов, которыми вы скорее всего никогда (по крайне мере в студенческой жизни) не воспользуетесь. \n\nСкачать можно отсюда \"Visual Studio 2010 Express All-in-One ISO\":http://download.microsoft.com/download/1/E/5/1E5F1C0A-0D5B-426A-A603-1798B951DDAE/VS2010Express1.iso\n\nВообще говоря можно скачать и **Visual Studio 2012 Express**, но я не уверен запустятся ли ваши программы на машинах что стоят в аудитории.\n\nСкачав образ диска его можно записать на диск, либо примонтировать с помощью например **DaemonTools**. И установить **Visual C# 2010 Express**.\n\nСтоит отметить что установленную программу надо зарегистрировать. Скорее всего программа сама предложит это вам через некоторое время. При регистрации придется указать свой **email**. Я указал одну из своих вполне рабочих почт, и за 3 года никакого спама не было. \nПри регистрации вам выдадут ключик.\n<hr>\n\nЛюбая программа на **C#** имеет следующую базовую конструкцию\n\npre(brush: csharp).. \nusing System;\nusing КакойТоВторойПакет;\nusing КакойТоТретийПакет;\n...\nusing КакойТо100500ыйПакет;\n\n\nnamespace Some_Namespace_Name\n{\n    // Любая программа является классом\n    class Some_Program\n    {\n        // тут начинается исполнение программы\n        static void Main(string[] args)\n        {\n            ...\n        }\n    }\n}\n\np. \n\n<div class=\"note\"> Создавая новую программу, **VisualStudio** автоматически создает так называемое пространство имен (в нашем случае **Some_Namespace_Name**), которое можно использовать при разработке другого приложения с помощью тех же операторов **using**, что у нас идут в самом начале программы. </div>\n\nТут я покажу как в **C#** приложении запросить у пользователя список чисел, и в качестве результата вывести на экран четные числа из этого списка.\n\npre(brush: csharp).. \nusing System;   // подключение пространства имен для использования основных типов данных\n                // int, String, String[], int[] и т.д. а также объекта Console\n\nnamespace ConsoleApplication1\n{\n    class Program\n    {\n        static void Main(string[] args)\n        {\n            /** все что находится между открывающей и закрывающей  \n               фиугрными скобками называется телом функции **/\n            ...\n        }\n    }\n}\n\np. \n\nВесь последующий код надо записывать в тело функции **static void Main(string[] args)**\n\nСначала нам надо выделить переменные которые мы будем использовать для хранения строки введенной пользователем, и под массив подстрок на которые мы разобьем введенную строку.\n\npre(brush: csharp).. \n// сюда сохраним строку введенную пользователем\nString strNumbers; \n// это массив для подстрок входящих в строку\nString[] strNumbersList;\n\np. \n\nЧерный экран консоли с серыми буквами уж больно депрессивен, так что почему бы и не добавить в него капельку радости:\n\npre(brush: csharp).. \n// установим заголовок консоли\nConsole.Title = \"Я заголовок этой мрачной консоли T_T\";\n// меняем цвет текста на голубой\nConsole.ForegroundColor = ConsoleColor.Cyan;\n// меняем цвет фона текста на темно-синий\nConsole.BackgroundColor = ConsoleColor.DarkBlue;\n\np. \n\nЗапрос данных у пользователя:\n\npre(brush: csharp).. \n// выводим на экран предложение ввести числа\nConsole.WriteLine(\"Введите числа через пробел:\");\n\n/** \n   приостанавливаем выполнения до тех пор пока пользователь не введет \n   некоторый текст и не нажмет ENTER,\n   введенную строку сохраним в переменную strNumbers\n**/\nstrNumbers = Console.ReadLine();\n\np. \n\nНу вроде строку текста от пользователя получили, теперь не плохо бы чего-нибудь с ней сделать. Так как предполагается что пользователь ввел нам список чисел через пробел, мы разобьем пробелами нашу\nстроку на подстроки. Разбивается строка функцией **Split**. \n\npre(brush: csharp).. \n// разобьем введенную пользователем сторку пробелами на подстроки\nstrNumbersList = strNumbers.Split(\' \');\n\np. \n\n<div class=\"note\"> Все переменный типа **String** обладают функцией **Split**, в качестве результат она возвращает массив строк, полученный разбиением строки разделителем указанным в качестве параметра.\n\npre(brush: csharp).. \nsome_variable.Split(\' \');\n\np. \n\nЕсли хочется использовать более одного разделителя (например пробел и запятую) придется написать уже вот-такое заклинание\n\npre(brush: csharp).. \nsome_variable.Split( new Char[]{\' \' , \',\'} );\n\n// или так, указывать тип массива не обязательно, в данном случае компилятор сам догадается по содержимому\nsome_variable.Split( new []{\' \' , \',\'} );\n\n// или так чтобы убрать пустые строки которые возникают, если у нас например два пробела подряд\nsome_variable.Split( new []{\' \' , \',\'}, StringSplitOptions.RemoveEmptyEntries );\n\np. \n</div>\n\nИногда вам захочется сбросить цвета в консоли на те что идут по умолчанию, для этого у объекта **Console** есть метод **ResetColor**. Я сброшу цвета консоли на те унылые, что были по умолчанию и выведу сообщение о том, что я сейчас я собираюсь вывести список четных чисел:\n\npre(brush: csharp).. \n// сбрасываем цвет фона и текста на скучные >_>\nConsole.ResetColor();\n// выводим на экран сообщение; это хорошая практика всегда держать пользователя в курсе событий\nConsole.WriteLine(\"Среди введенных чисел, следующие числа являются четными:\");\n\np. \n\nНу а теперь собственно то ради всего и затевалось, это вывод четных чисел на экран, каждое число в своей строчке. \nПерво наперво я верну свои веселые цвета:\n\npre(brush: csharp).. \n// меняем цвет текста на голубой\nConsole.ForegroundColor = ConsoleColor.Cyan;\n// меняем цвет фона на темно-синий\nConsole.BackgroundColor = ConsoleColor.DarkBlue; \n\np. \n\nНу и вторым шагом собственно сам вывод\n\npre(brush: csharp).. \n// проход по всем элементам массива strNumbersList, \n// свойство Length, очевидно, содержит количество элементов в массиве\nfor (int i = 0; i < strNumbersList.Length; ++i)\n{\n    // преобразуем подстроку в целое число\n    int num1 = int.Parse( strNumbersList[i] );  /** для доступа к i-му элементу массива\n                                                   используется операция индексации\n                                                   проще говоря чтобы узнать значение \n                                                   i-го элемента надо написать \n                                                   что-то вроде some_array[i], \n                                                  \n                                                   для 1-го элемента some_array[0]\n                                                   для 2-го элемента some_array[1]\n                                                   ...\n                                                   для последнего some_array[ some_array.Length - 1 ]\n                                                   да да нумерация с начинается с нуля!\n                                                **/\n                                                \n    // проверяем делиться ли число на 2 без остатка, то есть по сути проверка на четность\n    if (num1 % 2 == 0)\n    {\n        // если так выведем на экран это число\n        Console.WriteLine(num1);\n    }\n}\n\np. \n\n<div class=\"note\"> В C# четыре вида циклов:\n\npre(brush: csharp).. \n// 1. Стандартный сишный цикл. Перебор i от 0 до max_value - 1\nfor ( i=0; i < max_value; i++ ) \n{\n    ...\n}\n\n// 2. Цикл для работы с массивами и коллекциями. Проходит по всем элементам коллекции.\n// Не позволяет изменять значения коллекции, только смотреть их значение.\nforeach (SomeTy\np. value in some_array) \n{\n    ...\n}\n\n// ну и условные циклы\n\n// 3. С предусловием, запуститься только если условие истинно\nwhile( %some_condition_is_true% ) \n{\n    ...\n}\n\n// 4. С постусловием, обязательно сделает один тик, и только\n// потом пойдет проверять истинность условия\ndo\n{\n    ...\n}\nwhile( %some_condition_is_true% ) \n\np. \n\nА вот цикла вида **do ... until** - нет. Ну и пусть. Мы будем использовать в основном циклы вида 1 и 2.</div>  \n\nНу и последним шагом надо дать возможность пользователю рассмотреть выведенные числа. Для этого мы приостановим программу до тех пор пока пользователь не нажмет какую-нибудь клавишу.\n\npre(brush: csharp).. \n// Иначе консоль автоматически закроется\n// и весь вывод улетит в небытие...\nConsole.ReadKey();\n\np. \n\nВот и весь код ==\\(^_^)/==\n<hr>\n\nh2. Результат работы\n\n<div class=\"console\">\n%{background:DarkBlue;color:Cyan}Введите числа через пробел:<br>12 123 78 3 2<br>%\nСреди введенных чисел, следующие числа являются четными:<br>\n%{background:DarkBlue;color:Cyan}12<br>78<br>2%\n</div>\n\n<hr>\n\nh2. Полный листинг\n\npre(brush: csharp).. \nusing System;\nusing System.Linq;\n\nnamespace ConsoleApplication1\n{\n    class Program\n    {\n        static void Main(string[] args)\n        {\n            // сюда сохраним строку введенную пользователем\n            String strNumbers; \n            // это массив для подстрок входящих в строку\n            String[] strNumbersList; \n\n            Console.Title = \"Я заголовок этой мрачной консоли T_T\";\n\n            // меняем цвет текста на голубой\n            Console.ForegroundColor = ConsoleColor.Cyan;\n            // меняем цвет фона на темно-синий\n            Console.BackgroundColor = ConsoleColor.DarkBlue;\n\n            // выводим на экран предложение ввести числа\n            Console.WriteLine(\"Введите числа через пробел:\");\n            // приостанавиливаем выполнения до тех пор пока пользователь не введет \n            // некоторый текст и не нажмет ENTER,\n            // введенную строку сохраним в переменную strNumbers\n            strNumbers = Console.ReadLine();\n\n            // разобьем введенную пользователем сторку пробелами на подстроки\n            strNumbersList = strNumbers.Split(\' \');\n\n            // сбрасываем цвет фона и текста на те что идут по умолчанию\n            Console.ResetColor();\n            // выводим на экран сообщение\n            Console.WriteLine(\"Среди введенных чисел, следующие числа являются четными:\");\n\n            // меняем цвет текста на голубой\n            Console.ForegroundColor = ConsoleColor.Cyan;\n            // меняем цвет фона на темно-синий\n            Console.BackgroundColor = ConsoleColor.DarkBlue; \n\n            /// перебираем все элементы массива, нумерация элементов массива начинается от 0\n            for (int i = 0; i < strNumbersList.Length; ++i)\n            {\n                // преобразуем подстроку в целое число\n                int num1 = int.Parse(strNumbersList[i]);\n                // проверяем является число делиться ли оно на 2 без остатка\n                if (num1 % 2 == 0)\n                {\n                    // если так выведем на экран это число\n                    Console.WriteLine(num1);\n                }\n            }\n            // Иначе консоль автоматически закроется\n            // и весь вывод улетит в небытие...\n            Console.ReadKey();\n        }\n    }\n}\n\np. \n\n<hr>\n\nh2. Альтернативные варианты\n\nВообще говоря получить тот же результат можно еще как минимум 5 способами, я их на всякий пожарный оставлю здесь вдруг пригодится:\n\n<div class=\"note\">\n\nh3. Способ #2.\n\nС использованием цикла **foreach**. Наверное самый лучший способ в подобной ситуации. Я б использовал именно его.\n\npre(brush: csharp).. \nforeach (String subString in strNumbersList)\n{\n    // преобразуем подстроку в целое число\n    int num2 = int.Parse(subString);\n    // проверяем делиться ли число на 2 без остатка\n    if (num2 % 2 == 0)\n    {\n        // если так выведем на экран это число\n        Console.WriteLine(num2);\n    }\n}\n\np. \n\nh3. Способ #3.\n\nБолее хитрый способ с использованием встроенного языка **Linq**. Главное не забыть вверху подключить пространство имен System.Linq:\n\npre(brush: csharp).. \nusing System;\nusing System.Linq; // для использования функции Select\n\n...\n\n// формируем из массива подстрок массив целых чисел,\n// для этого используется функция Select\n// ей в качестве параметра передается функция которая применяется\n// к каждому элементу массива strNumbersList.\n// ToArray() - необходимо чтобы преобразовать резульат функции Select в массив\nint[] intArray = strNumbersList.Select(int.Parse).ToArray();\nforeach (int num3 in intArray)\n{\n    // проверяем делиться ли число на 2 без остатка\n    if (num3 % 2 == 0)\n    {\n        // если так выведем на экран это число\n        Console.WriteLine(num3);\n    }\n}\n\np. \n\nh3. Способ #4.\n\nЕще более хитрый способ с использованием лямбда выражений (это та часть что \"<b>x => x % 2 == 0</b>\"). Оказывается за один шаг можно преобразовать массив строк в массив целых чисел и сразу же отсеять нечетные числа:\n\npre(brush: csharp).. \nint[] evenNumbers = strNumbersList.Select(int.Parse).Where(x => x % 2 == 0).ToArray();\nforeach (int num4 in evenNumbers)\n{\n        // выведем на экран число\n        Console.WriteLine(num4);\n}\n\np. \n\nh3. Способ #5.\n\nБез использования цикла. С использованием функции **Join**. Функция **Join** является обратной для \nфункции **Split** и позволяет склеить массив строк в одну строку. Между каждыми элементами массива можно указать разделитель. Оказывается строку можно вывести как несколько строк для этого надо каждую подстроку отделить от другой символом перехода на новую строку <b>\"\\n\"</b> (в **VBS** это была константа **VbCrLf**). Например: cтрока %(consoleIn)\"Пожалуй хватит\\nна сегодня сишарпа\"% в консоли будет выведена как:\n\nnotextile.. \n<div class=\"console\">\nПожалуй хватит<br>\nна сегодня сишарпа\n</div>\n\np. \nСпособ выглядит вот так:\n\npre(brush: csharp).. \n// здесь мы одной строкой преобразовываем все подстроки к числам,\n// и среди этих чисел выбираем четные числа\nint[] evenNumbers2 = strNumbersList.Select(int.Parse).Where(x => x % 2 == 0).ToArray();\n\n// из массива целых чисел формируем массив строк\nString[] evenNumbersStr = evenNumbers2.Select(x => x.ToString()).ToArray();\n\n// склеиваем все элементы масива строк в одну большую строку outputString\n// String.Join(%разделитель строк%, %массив_строк%) возвращает объедененую строку\n// \"\\n\" - знак обозначает переход на новую строку\nString outputString = String.Join(\"\\n\", evenNumbersStr);\n\n// выводи эту строку на экран\nConsole.WriteLine(outputString);\n\np. \n\nh3. Способ #6.\n\nСтоит отметить, что способ 5 умещается в одну длинную мультикоманду. Не рекомендуется к использованию, так как сильно затрудняет восприятие кода,\n\npre(brush: csharp).. \nConsole.WriteLine(String.Join(\"\\n\",strNumbersList.Select(int.Parse).Where(x => x % 2 == 0).Select(x => x.ToString()).ToArray()));\n\np. </div>',1,1,0,242,0,1391936620),(3,'Коллекции','Коллекции','Коллекции','',2,'\np(#toc).  \n\nnotextile.. \nКоллекции являются своего рода динамическим массивами. Я собираюсь рассмотреть работу с коллекциями \nна примере списков (List) и словарей (Dictionary).\nСоздадим обыкновенное консольное приложение\n<pre class=\"brush: csharp\">\nusing System; // подключим пространство имен для работы с онсновными типами и консолью\nusing System.Collections.Generic; // для работы с коллекциями\nusing System.Linq; // для использование встроенного языка Linq\n\nnamespace ConsoleApplication1\n{\n	class Program\n	{\n		static void Main(string[] args)\n		{\n            \n		}\n	}\n}\n</pre>\nОпять же весь код ниже надо будет вписать в тело функции <b>static void Main(string[] args).</b>\n<p>\nВ данном приложении я для ускорения процесса, \"захардкодю\" строку ввода, чтобы не вводить ее по 100 раз.\nИ хотя работать я собираюсь сегодня со списком чисел, я намерено добавлю паразитных элементов в строку.\n<pre class=\"brush: csharp\">\n/* \n	чтобы положить чего то в строку совсем необязательно \n	запорашивать это \"чего-то\" от пользователя, можно явно указать строку\n*/\nString strNumbers = \"123 bz 12, 53, asd 7 91 15\";\n</pre>\nЧтобы разбить строку на подстроки, а тут в качестве разделителей используется не только пробелы но и запятые,\nпридется использовать усложненную версию функции <b>Split</b>\n<pre class=\"brush: csharp\">\n// массив разделителей\nChar[] separators = new Char[] { \' \', \',\' };\n\n/* \n	Создаем переменную для хранения списка строк, \n	полученных путем разбиения сторки strNumbers \n	разделителями из массива separators.\n\n	Второй параметр устанавливаем на StringSplitOptions.RemoveEmptyEntries\n	чтобы избежать появления пустых строк в массиве strNumbersArray,\n	которые возникают если два разделителя стоят рядом (например два подряд идущих пробела) \n*/\nString[] strNumbersArray = strNumbers.Split(separators, StringSplitOptions.RemoveEmptyEntries);\n</pre>\n<hr>\n<h2>Списки. Тип List<int></h2>\nТак как нашей целью является изучить возможности работы со списками, необходимо этот список создать.\nДля большинства объектов (типов) с которыми вы столкнетесь необходимо будет использование оператор new.\n<pre class=\"brush: csharp\">\n/* \n	Данное предложение читается справа налево, т.е. \n	создать в памяти объект типа List<int> (список целых чисел),\n	и установить numbers как ссылку на этот объект\n*/\nList<int>numbers = new List<int>();\n</pre>\nТеперь этот список надо наполнить числами полученные преобразованием элементов массива <b>strNumbersArray</b> в числа.\nОчевидно что не все элементы массива <b>strNumbersArray</b> являются числами, если вывести сейчас массив <b>strNumbersArray</b> на экран \nто мы увидим примерно следующую картину:\n<div class=\"console\">\n123<br>\nbz<br>\n12<br>\n53<br>\nasd<br>\n7<br>\n91<br>\n15<br>\n</div>\nОчевидно, что <span class=\"consoleIn\">bz</span> и <span class=\"consoleIn\">asd</span> не являются числами.\nДля заполнения списка числами мы будем использовать цикл <b>foreach</b> внутри которого будет вызываться функция\n<b>TryParse </b>которая позволяет проверить строку на ее возможность преобразования в число, если такая возможность\nесть то в она возвращает true и во второй параметр передает результат преобразования.\n\n<pre class=\"brush: csharp\">\n// проходим по всем подстрокам\nforeach (Strig strNumber in strNumbersArray)\n{\n	int num;\n	/*\n		тут мы проверяем можно ли преобразовать строку в число\n		если преобразование возможно то результат преобразования\n		будет положен в переменную num, которую мы создали шагом выше\n	*/\n	if ( int.TryParse(strNumber, out num) == true )\n	{\n		numbers.Add(num);\n	}\n}\n</pre>\n\n<div class=\"note\">\nФункция объекта <b>int</b> по имени <b>TryParse</b> представляет собой функцию возвращающая сразу два значение \n<pre class=\"brush: csharp\">\nint.TryParse(strNumber, out num)\n</pre>\nПервое значение мы используем когда сравниваем значения функции с константой <b>true</b>\n<pre class=\"brush: csharp\">\n// не обращаем внимание на многоточие\nif ( int.TryParse( ... ) == true )\n...\n// можно было записать это и так выделив дополнительную переменную \n// для сохранения результата функции\nbool tryParseResult = int.TryParse( ... );\nif ( tryParseResult == true )\n...\n</pre>\nЭта же функция в случае успешной конвертации возвращает еще одно значение, \nоно передается во второй параметр. Чтобы получить к нему доступ необходимо \nсоздать дополнительную переменную и передать ее в качестве второго параметра \nвместе с ключевым словом <b>out</b>:\n<pre class=\"brush: csharp\">\n...\n// создаем переменную для хранения результата преобразования\nint num;\n// пытаемся преобразовать строку some_string в число\nif ( int.TryParse(some_string, out num) ) \n{\n	// если преобразование было успешным то выводим на экран это число	\n	Console.WriteLine(num);\n} \nelse \n{\n	// в случае неудачи сообщим что данная строка не является числом	\n	Console.WriteLine(some_string + \" не является числом >_>\");\n}\n</pre>\nТо есть должно быть очевидно, что если <b>some_string == \"123\"</b>, \nна консоле увидим:\n<div class=\"console\">\n123\n</div>\nЕсли же <b>some_string == \"фонарик\"</b>, на консоле увидим:\n<div class=\"console\">\nфонарик не является числом >_>\n</div>\n</div>\n<p>\nПосле выполнения всех этих операций список <b>numbers</b> будет содержать \nчисла, (если быть точным, то с учетом того какую строку мы задали \nв списке будут числа <b>123, 12, 53, 7, 91, 15</b>, именно в таком порядке)\n<p>\nТеперь выведем их на экран\n<pre class=\"brush: csharp\">\n// сообщим пользователю о том что собираемся показать все числа в списке\nConsole.WriteLine(\"Исходный список:\");\n\n// выведем список на экран\nforeach(int number in numbers) Console.Write(number + \" \");\n\n/*\n	так как фукнция Console.Write в отличие от Console.WriteLine \n	не переводит курсор на новую строку, то я вызову функцию Console.WriteLine \n	чтобы такое переход осуществить собственноручно\n*/\nConsole.WriteLine();\n</pre>\nУпорядочивание элементов в C# -- милое дело, все делается в одну-две команды\n<h4>Сортировка по возрастанию</h4>\n<pre class=\"brush: csharp\">\n// функция Sort сортирует элементы списка в порядке возрастания\nnumbers.Sort();\n\n// вывод на экран\nConsole.WriteLine(\"Упорядоченный по возрастанию:\");\nforeach(int number in numbers) Console.Write(number + \" \");\nConsole.WriteLine();\n</pre>\n\n<h4>Сортировка по убыванию</h4>\n<pre class=\"brush: csharp\">\n// сначала отсортируем по возрастанию \nnumbers.Sort();\n// а потом развернем список \n// вообще не самый эффективный способ, \n// но вполне пригодный для небольших списков\nnumbers.Reverse();\n\n// вывод на экран\nConsole.WriteLine(\"Упорядоченный по возрастанию:\");\nforeach(int number in numbers) Console.Write(number + \" \");\nConsole.WriteLine();\n</pre>\n<div class=\"note\">\nБолее эффективным способом упорядочения списка по убыванию, заключается в явном указании функции сортировки:\n<pre class=\"brush: csharp\">\nnumbers.Sort( (num1, num2) => num2.CompareTo(num1) );\n</pre>\nЗдесь используется лямбда-выражение, которым реализуется функция от двух параметров \nвозвращающая<br>\n<b>-1</b> если <b>num1 > num2</b>,<br>\n<b>1</b> если <b>num1 < num2</b><br> \n<b>0</b> если они совпадают.\n</div>\n<h4>Количество элементов в списке</h4>\n<pre class=\"brush: csharp\">\nConsole.Write\"Количество элементов в списке: \");\n// используем свойстве списка count\nConsole.WriteLine(numbers.count);\n</pre>\n\n<h4>Минимальный элемент</h4>\n<pre class=\"brush: csharp\">\n/*\n	в отличие от количества элементов, под минимальный элемент\n	лучше создать переменную, так как при каждом вызове функции Min\n	этот элемент ищется заново\n*/\nint minimum = numbers.Min();\n\nConsole.Write(\"Минимальный элемент: \");\nConsole.WriteLine(minimum);\n</pre>\n\n<h4>Максимальный элемент</h4>\n<pre class=\"brush: csharp\">\n/*\n	и под максимальный элемент лучше создать переменную, \n	так как при каждом вызове функции Max\n	этот элемент также ищется заново.\n*/\nint maximum = numbers.Max();\n\nConsole.Write(\"Максимальный элемент: \");\nConsole.WriteLine(maximum);\n</pre>\n<hr>\n<h2>Словари. Тип Dictionary<String, String></h2>\nСловари позволяют нам хранить пары вида (ключ, значение). Наилучшим примером объекта типа словарь,\nявляется, как бы это странно это не звучало, обычный словарь. Например русско-английский. Я продемонстрирую\nкак сделать словарь который будет переводить предложения не хуже печально известного Промта. \n<p>\nКак и любой объект сложнее <b>int</b> (ну или <b>String</b>, <b>float</b>, <b>long</b> и т.п.), словарь надо создавать с помощью оператора <b>new</b>:\n<pre class=\"brush: csharp\">\nDictionary<String, String> dictionary = new Dictionary<string, string>();\n/*\n	не обязательно указывать тип явно можно написать и так\n	var dictionary = new Dictionary<string, string>();\n*/\n</pre>\n\nТеперь добавим несколько слов в наш словарь\n<pre class=\"brush: csharp\">\n// первый параметр функции Add это ключ, второй - значение\ndictionary.Add(\"яблоко\", \"apple\");\ndictionary.Add(\"мороженое\", \"icecream\");\ndictionary.Add(\"чай\", \"tea\");\n</pre>\nВыводим содержимое словаря на экран\n<pre class=\"brush: csharp\">\nforeach (var pair in dictionary)\n{\n	/*\n	  Тут мы используем форматирование выводимого текста\n	  {0} - будет заменено на второй параметр функции WriteLine (т.е на значение pair.Key)\n	  {1} - будет заменено на третий параметр функции WriteLine (т.е на значение pair.Value)\n	  \n	  Аналогично можно добавить {2} - если у нас вдруг появиться какой-то третий параметр \n	*/	\n	Console.WriteLine(\"{0} по-английски {1}\", pair.Key, pair.Value);\n}\n</pre>\nДобавим следующее приложение:\n<pre class=\"brush: csharp\">\nString sentence = \"Я пожалуй возьму яблоко, мороженое и чай\";\n</pre>\nИ воспользуемся нашим словарем для перевода (так как в нашем словаре только три слова,\nследовательно и перевести мы сможем  только три слова, ну для начала и так не плохо :D \n<pre class=\"brush: csharp\">\n// сначала покажем исходное предложение\nConsole.WriteLine(sentence);\n\n/*\n	собственно тут и осуществляется перевод,\n	для упрощения, я вместо того чтобы искать \n	слова из текста в словаре, будут искать \n	слова из словаря в тексте. \n	\n	Нелогично, зато код во много раз проще,\n	иначе бы мне пришлось разбивать текст \n	на слова, искать каждое слово в словаре,\n	а потом еще эти слова уже склеивать обратно\n	в предложение, что, вообще говоря, является\n	нетривиальной задачей.\n*/\n\nforeach (var wordPair in dictionary)\n{\n	/*\n	  Функция Replace ищет в строке для которой она вызывается\n	  значение первого параметра и заменяет его значением второго параметра.\n	  \n	  В качестве результата  возвращает новую строку которая является\n	  преобразованным предложением.\n	  \n	  Тут мы присваиваем значение функции самой строке, чтобы на следующей\n	  итерации цикла уже использовалось новое предложение \n	  в котором часть слов уже переведена\n	*/	 \n	 sentence = sentence.Replace(wordPair.Key, wordPair.Value);\n}\n\n// вывод на экран переведенного предложения\nConsole.WriteLine(sentence);\n</pre>\nНу и последним шагов приостанавливаем работу программы в ожидании нажатия любой клавиши\nпользователем, иначе консолька автоматически закроется.\n<pre class=\"brush: csharp\">\n// ожидаем нажатия любой клавиши пользователем\nConsole.ReadKey();\n</pre>\n\n<hr>\n<h2>Результат работы</h2>\n<div class =\"console\">\nИсходный список:<br>\n123 12 53 7 91 15<br>\nУпорядоченный по возрастанию:<br>\n7 12 15 53 91 123 <br>\nУпорядоченный по убыванию:<br>\n123 91 53 15 12 7 <br>\nКоличество элементов: 6<br>\nМинимальный элемент: 7<br>\nМаксимальный элемент: 123<br>\nмороженое по-английски icecream<br>\nчай по-английски tea<br>\nяблоко по-английски apple<br>\nЯ пожалуй возьму яблоко, мороженое и чай<br>\nЯ пожалуй возьму apple, icecream и tea<br>\n_\n</div>\n<hr>\n<h2>Полный листинг</h2>\n<pre class=\"brush: csharp\">\nusing System;\nusing System.Collections.Generic;\nusing System.Linq;\n\n\nclass Program\n{\n    static void Main(string[] args)\n    {\n        // чтобы положить чего то в строку совсем необязательно \n        // заправшивать чего-то от пользователя, можно явно указать строку\n        String strNumbers = \"123 bz 12, 53, asd 7 91 15\";\n\n        // разбиваем строку запятыми и пробелами, и убираем за одно пустые строки\n        Char[] separators = new Char[] { \' \', \',\' };\n        String[] strNumbersArray = strNumbers.Split(separators, StringSplitOptions.RemoveEmptyEntries);\n\n        List<int> numbers = new List<int>(); // создаем динамический список\n\n        // проходим по всем подстрокам\n        foreach (String strNumber in strNumbersArray)\n        {\n            int num;\n            // тут мы проверяем можно ли преобразовать строку в число\n            if (int.TryParse(strNumber, out num))\n            {\n                numbers.Add(num);\n            }\n        }\n\n        Console.WriteLine(\"Исходный список:\");\n        foreach(int number in numbers) Console.Write(number + \" \");\n        Console.WriteLine();\n\n        // функция Sort сортирует элменты массива в порядке возрастания\n        numbers.Sort();\n        \n        Console.WriteLine(\"Упорядоченный по возрастанию:\");\n        foreach(int number in numbers) Console.Write(number + \" \");\n        // чтобы не слипалось со следующем выводом\n        Console.WriteLine();\n\n        // упорядочим список по убыванию\n        numbers.Sort();\n        numbers.Reverse();\n        \n        Console.WriteLine(\"Упорядоченный по убыванию:\");\n        foreach(int number in numbers) Console.Write(number + \" \");\n        Console.WriteLine();\n\n		  Console.Write(\"Количество элементов: \");\n        Console.WriteLine(numbers.Count);\n\n        int minimum = numbers.Min();\n        Console.Write(\"Минимальный элемент: \");\n        Console.WriteLine(minimum);\n\n        int maximum = numbers.Max();\n        Console.Write(\"Максимальный элемент: \");\n        Console.WriteLine(maximum);\n\n        Dictionary<String, String> dictionary = new Dictionary<string, string>();\n        dictionary.Add(\"яблоко\", \"apple\");\n        dictionary.Add(\"мороженое\", \"icecream\");\n        dictionary.Add(\"чай\", \"tea\");\n\n        dictionary = dictionary.OrderBy(pair => pair.Key).ToDictionary(pair => pair.Key, pair => pair.Value);\n\n        foreach (var pair in dictionary)\n        {\n            Console.WriteLine(\"{0} по-английски {1}\", pair.Key, pair.Value);\n        }\n\n\n        String sentence = \"Я пожалуй возьму яблоко, мороженое и чай\";\n\n        Console.WriteLine(sentence);\n        foreach (var wordPair in dictionary)\n        {\n            sentence = sentence.Replace(wordPair.Key, wordPair.Value);\n        }\n        Console.WriteLine(sentence);\n		\n\n        Console.ReadKey();\n    }\n}\n</pre>',1,2,0,143,0,1391936685),(4,'Работа с файлами','Работа с файлами','Работа с файлами','',2,'\nnotextile.. \nВ качестве файла для экспериментов я возьму текст книги <a href=\"files/%D0%90%D0%BB%D0%B8%D1%81%D0%B0%20%D0%B2%20%D0%97%D0%B0%D0%B7%D0%B5%D1%80%D0%BA%D0%B0%D0%BB%D1%8C%D0%B5.txt\">\"Алиса в Зазеркалье\"</a>, вы можете\nиспользовать этот файл либо какой-нибудь свой, главное чтобы это был простой текст (<b>*.txt</b>).\n<p>\nСоздадим простое консольное приложение:\n<pre class=\"brush: csharp\">\nusing System; 		 // базовые типы\nusing System.Text; // для работы с кодировками\nusing System.IO;	 // для работы с фалами\nusing System.Collections.Generic; // для работы с коллекциями\nusing System.Linq; // \nдля использования конструкций языка Linq\n\nnamespace ConsoleApplication1\n{\n	class MainClass\n	{\n		public static void Main (string[] args)\n		{\n		}\n	}\n}\n</pre>\nВозможны вы уже обратили внимание что у функции <b>public static void Main (string[] args)</b>. \nПрисутствует параметр <b>string[] args</b>. Это так называемые аргументы командной строки, их используют\nдля того чтобы контролировать поведение консольных приложений. Их количество и вид определяет разработчик программы.\nНапример команду <b>copy</b> консольной оболочки Windows (чтобы запустить консоль нажмите <b>Win+R</b>, введите <b>cmd</b> и нажмите <b>ENTER</b>) , можно вызвать следующим образом:\n<div class=\"console\">\ncopy somefile.txt d:\\Texts\n</div>\nПрограмме <b>copy</b> передается два аргумента (аргументы отделяются друг от друга пробелами, если параметр может содержать пробелы его надо заключить в кавычки, например: <b>copy \"Some file with spaces in name.txt\" d:\\Texts</b> ):<br>\n<b>somefile.txt</b> — файл для копирования <br>\n<b>d:\\Texts</b> — папка назначения, туда куда скопируется файл <br>\nЕсли бы мы были разработчиками программы <b>copy</b>, то мы могли бы обратиться к этим аргументам через параметр <b>string[] args</b>.<br>\n<ul>\n<li><b>args</b> — это массив строк</li>\n<li><b>args[0]</b> — хранит первый аргумент переданный в командную строку \n(т.е. для данного примера он содержал <b>\"somefile.txt\"</b>)</li>\n<li><b>args[1]</b> — хранит второй аргумент переданный в командную строку \n(т.е. для данного примера он содержал <b>\"d:\\Texts\"</b>)</li>\n<li>и т.д.</li>\n</ul>\n<p>\nВ нашем приложении мы тоже будем использовать два параметра: для указания файла с текстом \nи для папки куда мы будем сохранять результаты обработки текста. Но мы же не собираемся запускать \nпрограмму из консоли, мы просто тыкаем <b>F5</b> и все делается на автомате. Чтобы передать параметры\nприложению необходимо сделать небольшие манипуляции.\n<br>Открыть свойства проекта:\n<img class=\"img-small\" src=\"images/project_properties.png\" />\nВыбрать вкладку Debug (отладка):\n<img class=\"img-small\"  src=\"images/project_properties_debug.png\" />\nИ прописать туда параметры через пробел, как видите так как путь к книге \"Алиса в Зазеркалье\" содержит\nпробелы я заключаю его в двойные кавычки.\n<p>\nМожно закрыть вкладку свойств и перейти к написанию кода, как обычно весь код помещаем \nв тело функции <b>public static void Main (string[] args)</b>\n<p>\nСоздадим две переменные для хранения первого и второго аргумента (вообще говоря это необязательно,\nмы могли бы просто использовать <b>args[0]</b> и <b>args[1]</b>, но они имена не несут никакой смысловой\nнагрузке, и через неделю другую вам будет достаточно тяжело вспомнить для чего и какой аргумент использовался.\n<pre class=\"brush: csharp\">\nString inputFile = args [0]; // файл с текстом\nString outputDir = args [1]; // папка куда будем сохранять файл\n</pre>\nТеперь сделаем небольшую проверку, вдруг пользователь подсунет нам файл которого\nне существует или и вовсе какую ерунду. Для этого воспользуемся методом <b>Exists</b> класса <b>File</b>, \nкоторый возвращает <b>true</b> если файл существует и <b>false</b> в обратном случае. \n<pre class=\"brush: csharp\">\n// если файл не существует\nif ( !File.Exists (inputFile) ) {\n\n	// сообщить об этом пользователю\n	Console.WriteLine(\"файла \\\"\" + inputFile + \"\\\" не существует!\");\n	\n	// дать возможность прочитать сообщение	\n	Console.ReadKey();\n	\n	// завершить программу\n	return;\n}\n</pre>\n<div class=\"note\">\nВозможно вы обратили внимание что мы используем <b>\\</b> для того что выводить кавычки. \n<pre class=\"brush: csharp\">\n... \nConsole.WriteLine(\"файла \\\"\" + inputFile + \"\\\" не существует!\");\n...\n</pre>\nСвязанно это с тем, что кавычки являются зарезервированным символом поэтому чтобы вывести сроку содержащую\nкавычки необходимо кавычки в ней \"экранировать\" с помощью обратного слеша. Таким образом, чтобы создать строку содержащую\nнеобходимо \nделать так:\n<pre class=\"brush: csharp\">\nString some_string = \"\\\"\"; // с одним символом двойных кавычек\n...\nString another_string = \"\\\"\\\"\";// с двумя символами двойных кавычек\n...\nString other_string = \"\\\\\"; // с обратным слешом\n...\nString freak_string = \"\\\\\\\"\\\\\"; // с символом двойных кавычек, между двумя обратными слэшами \n</pre>\nПоследняя строка уж совсем страшная.<br>\n<b>C#</b> предлагает нам альтернативный способ задания строк\nсодержащих много экранированных символов. С использованием символа <b>@</b> (at - по-английски). \nС помощью <b>@</b> последняя строка может быть записана как\n<pre class=\"brush: csharp\">\nString freak_string = @\"\\\"\"\\\"; \n/*\n  кавычки все равно приходится экранировать, повторяя их два раза\n    \n  два раза повторенная двойная кавычка \n  будет выведена как один символ двойной кавычки\n*/\n</pre>\nВ основном символ используют для задания путей в <b>Windows</b> (в <b>UNIX</b> подобных системах, в путях используется прямой слэш\nи таких проблем там не возникает):\n<pre class=\"brush: csharp\">\n// без @:\nString path1 = \"C:\\\\somedir\\\\anotherdir\\\\somefile.jpeg\";\n\n// с использованием @:\nString path2 = @\"C:\\somedir\\anotherdir\\somefile.jpeg\";\n\n// вывести строки на экран\nConsole.WriteLine(path1);\nConsole.WriteLine(path2);\n</pre>\nВыведутся на консоль обе строки абсолютно одинаково.\n<div class=\"console\">\nC:\\somedir\\anotherdir\\somefile.jpeg<br>\nC:\\somedir\\anotherdir\\somefile.jpeg\n</div>\n</div>\n<p>\nТеперь считаем содержимое файла в и сохраним в строку\n<pre class=\"brush: csharp\">\n/*\n	Кодировки это большая головная боль\n	если у вас вместо букв вылезут вопросики\n	попробуйте в качестве второго параметра \n	один из следующих вариантов:\n	\n	Encoding.GetEncoding (1251)\n	Encoding.Default;\n	Encoding.UTF8\n*/\nString fullText = File.ReadAllText (inputFile, Encoding.GetEncoding (1251));\n/*\n	выведем текст на экран,\n	кстати если текст достаточно большой\n	то в консоль он весь не влезет (даже с учетом прокрутки)\n*/\nConsole.Write(fullText);\n</pre>\nЯ хочу провести частотный анализ появления слов в тексте, для этого мне надо\nпрежде всего текст разбить на слова. Я воспользуюсь уже знакомой с прошлых уроков функцией\n<b>Split</b>, а в качестве разделителей выберу следующие символы:\n<pre class=\"brush: csharp\">\n/*\n	этот далеко не полный список разделителей, но и такой пойдет\n	обратите внимание на два последних символа,\n	\'\\n\' - символ перехода на новую строку\n	\'\\r\' - символ возврата каретки\n	эти символы не являются печатными, \n	но тем не менее в тексте присутствуют.\n*/\nChar[] separators = {\' \', \',\', \'.\', \'-\', \'!\', \'?\', \'\\\"\', \'\\n\', \'\\r\' };\n</pre>\nСформируем список слов:\n<pre class=\"brush: csharp\">\nString[] wordsArray = fullText.Split (separators, StringSplitOptions.RemoveEmptyEntries);\n</pre>\nТеперь я хочу создать новый список состоящий из пар: слово + кол-во появлений слова в тексте.\nДля этого как нельзя лучше подходят класс <b>Dictionary</b>. \nВ прошлом уроке я использовал словарь типа <b>Dictionary<String, String></b>. \n<p>Сегодня я буду использовать словарь вида <b>Dictionary<String, int></b>. Создам его:\n<pre class=\"brush: csharp\">\n/*\n	мне лень явно указывать тип переменной\n	к тому же он вполне очевиден из правой части \n*/\nvar dictWords = new Dictionary<String, int> ();\n</pre> \nА теперь мне надо заполнить этот словарь элементами. Для этого я организую цикл по всем словам из списка слов текста:\n<pre class=\"brush: csharp\">\n// для каждого слова из списка слов\nforeach (var word in wordsArray) \n{\n	// если словарь не содержит слово	\n	if (!dictWords.ContainsKey (word)) \n	{\n		/*\n			добавляем слово в качестве ключа в словарь,\n			его значение устанавливаем единичкой,\n			что означает — слово один раз в тексте встречалось,\n			таки так оно \nи есть\n		*/		\n		dictWords.Add (word, 1);\n	} \n	else  // а если встречалось\n	{\n		/*\n			в таком случае добавлять слово с словарь не надо\n			но надо увеличить значение для слова на 1 \n		*/\n		dictWords [word] += 1;\n	}\n}\n</pre>\n<div class=\"note\">\nВ таком виде программа различает слова начинающиеся с большой и маленькой буквы, т.е. <b>алиса</b> и <b>Алиса</b> будут восприняты как два разных слова, вообще говоря такое поведение не логично, чтобы поправить ситуацию можно например переписать так:\n<pre class=\"brush: csharp\">\nforeach (var word in wordsArray) \n{\n	/*\n		введем дополнительную переменную, которая все слова будет переводить\n		в нижний регистр и уже для этого слова мы будем решать\n		добавлять его в словарь или изменять его значение\n	*/  	\n	String lowerWord = word.ToLower(); 	\n	\n	// если словарь не содержит слово	\n	if (!dictWords.ContainsKey (lowerWord)) \n	{\n		/*\n			добавляем слово в качестве ключа в словарь,\n			его значение устанавливаем единичкой,\n			что означает — слово один раз в тексте встречалось,\n			таки так оно и есть\n		*/		\n		dictWords.Add (lowerWord, 1);\n	} \n	else  // а если встречалось\n	{\n		/*\n			в таком случае добавлять слово с словарь не надо\n			но надо увеличить значение для слова на 1 \n		*/\n		dictWords [lowerWord] += 1;\n	}\n}\n</pre>\n</div>\nНу а теперь самое интересное, мы могли бы вывести на экран какое слово сколько раз\nвстречалось, но вместо этого, мы будем производить вывод в файл. Для этого создадим объект\n<b>StreamWriter</b> который позволяет производить операции записи над файлом указанном\nв качестве параметра при его инициализации. \n<pre class=\"brush: csharp\">\nStreamWriter writer = new  StreamWriter(outputDir + @\"\\words.txt\");\n</pre>\nА теперь запишем информацию о нашем анализе в текстовый файл:\n<pre class=\"brush: csharp\">\n/*\n	Я воспользуюсь возможностью упорядочения на лету\n	с помощью функции OrderBy, \n	и укажу что хочу упорядочить по значению\n*/\nforeach (var pair in dictWords.OrderBy( x => x.Value ) ) \n{\n	/*\n		Напоминаю что \"{0,-14}: {1}\" — это шаблон форматирования строки\n		сам шаблон означает вывести первый аргумент, если строковое значение\n		первого аргумента длиной меньше 14 символов добавить к нему справа пробелов \n		чтобы она равнялась 14 (если б стояло просто 14, то обозначало бы добавить слева), \n		\n		нарисовать двоеточие, \n		вывести второй аргумент\n		\n		все данные записываются в файл\n	*/	\n	writer.WriteLine(\"{0,-14}: {1}\", pair.Key, pair.Value);\n}\n\n// так как мы больше ничего не собираемся делать с этим файлом, его необходимо закрыть\nwriter.Close();\n</pre>\nМожно открыть файл и полюбоваться результатом. Вот несколько строчек из моего файла:\n<div class=\"console\">\nКоролева      : 168<br>\nа             : 170<br>\nто            : 170<br>\nтак           : 178<br>\nИ             : 185<br>\nА             : 189<br>\nон            : 219<br>\nэто           : 219<br>\nя             : 243<br>\nкак           : 291<br>\nс             : 304<br>\nона           : 327<br>\nАлиса         : 488<br>\nчто           : 492<br>\nна            : 516<br>\nне            : 654<br>\nв             : 692<br>\nи             : 936\n</div>\nЕсли уже забыли, то в первой колонке у нас слова, а в правой то сколько раз они встретились в тексте. \n<p>Теперь попробуем сделать частотный анализ букв, в отличие от слов, для этого разбивать текст не надо, достаточно использовать исходный текст, мы можем обращаться к символом текста через операцию индексации. Но сначала создадим новый словарь. В качестве ключа будем использовать букву, а в качестве значения, то сколько раз она встречалась в тексте.\n<pre class=\"brush: csharp\">\nvar dictChars = new Dictionary<Char, int>();\n</pre>\nТеперь организуем цикл по всем символам текста:\n<pre class=\"brush: csharp\">\n// проходим по всем символам в тексте \nforeach (Char ch in fullText) {\n	/*\n		нас интересует лишь частотный анализ букв\n		поэтому мы использую статический метод IsLetter\n		класса Char, проверяем является ли символ буквой\n	*/ \n	if ( Char.IsLetter(ch) ) \n	{\n		// если такой буквы нет в словаре		\n		if ( !dictChars.ContainsKey (ch) ) \n		{\n			// добавляем ее в словарь, устанавливаем ее значение на 1\n			dictChars.Add (ch, 1);			\n		} \n		else  // а если есть\n		{\n			// увеличиваем значение буквы на один			\n			dictChars [ch] += 1;\n		}\n	}\n}\n</pre>\nПосле выполнения этого цикла наш словарь будет содержать информацию о том сколько раз\nкаждая буква встречалась в тексте.\n<p>Теперь рассмотрим альтернативный способ записи текста в файл.\nФункция <b>WriteAllText</b> класса <b>File</b>, позволяет записать строку в файл, за\nодин шаг, главное чтобы строка к этому моменту была сформирована. Формировать строку очень \nудобно с помощью объекта <b>StringBuilder</b>.\n<pre class=\"brush: csharp\">\n// создадим объект для формирования строк\nStringBuilder outString = new StringBuilder ();\n/*\n  для каждой пары: буква - кол-во появлений в тексте\n  как и в предыдущем примере я упорядочиваю на лету по значению\n*/\nforeach (var pair in dictChars.OrderBy( x => x.Value ) ) \n{\n	// рассчитываем долю появления буквы к количеству символов в тексте \n	// это число очевидно меньше единицы 	\n	double freq = (double) pair.Value / fullText.Length;\n\n	/* \n		добавляю строку\n		{0,-3} - выделить три символа с выравниванием влево под символ буквы \n		{1:0.000%} - вывести долю в процентах, с точностью до третьего знака после запятой\n	*/ \n	outString.AppendFormat(\"{0,-3}: {1:0.000%}\", pair.Key, freq);\n	\n	// добавить символ перехода на новую строку\n	outString.AppendLine();\n}\n</pre>\n<div class=\"note\">\nСтоит отметить что тут (<b>double freq = (double) pair.Value / fullText.Length</b>) \nмы сравниваем частоту появления буквы относительно количества символов в тексте\n(не только букв, но и знаков препинания, пробелов, цифр и т.д.), более правильно было бы\nвместо <b>fullText.Length</b>, ввести дополнительную переменную хранящую кол-во букв в тексте\n<pre class=\"brush: csharp\">\n/*\n	Тут мы используем Linq-функцию Count которая возвращает кол-во элементов в массиве,\n	для которых функция, указанная в качестве параметра, возвращает true\n*/\nint lettersCount = fullText.Count(Char.IsLetter);\n/*\n	равносильная запись \n	int lettersCount = fullText.Count( ch => Char.IsLetter(ch));\n*/\n</pre>\nНу и заменить пересчет доли\n<pre class=\"brush: csharp\">\n...\ndouble freq = (double) pair.Value / lettersCount;\n...\n</pre>\n</div>\n<p>\nНу а теперь мы эту строку сформированную объектом <b>outString</b> типа <b>StringBuilder</b> сохраним в файл:\n<pre class=\"brush: csharp\">\n/*\n	Так как StringBuilder не является строкой,\n \n	а является чем то вроде контейнера для хранения строки\n	строку надо извлечь с помощью метода ToString(), \n	\n	кстати методом ToString() обладают абсолютно все объекты в C#	\n*/\nFile.WriteAllText(outputDir + @\"\\chars.txt\" ,outString.ToString());\n</pre>\nВот несколько строк из моего файла:\n<div class=\"console\">\nь  : 1.503%<br>\nп  : 1.814%<br>\nу  : 1.967%<br>\nд  : 1.982%<br>\nм  : 2.101%<br>\nк  : 2.497%<br>\nв  : 2.823%<br>\nр  : 3.268%<br>\nс  : 3.901%<br>\nл  : 4.145%<br>\nн  : 4.286%<br>\nт  : 4.379%<br>\nи  : 4.496%<br>\nе  : 5.931%<br>\nа  : 6.579%<br>\nо  : 8.126%<br>\n</div>\n для интереса слазайте <a href=\"http://ru.wikipedia.org/wiki/%D0%A7%D0%B0%D1%81%D1%82%D0%BE%D1%82%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" target=\"_blank\">сюда</a> и сравните порядок букв с тем что в вашем файле\n(напомню что буквы я упорядочил по частоте появления в тексте)\nНу напоследок откроем созданные файлы программно, мы конечно могли бы\nдойти до папки и в ручную открыть их, но ведь нам лень .__.\n<pre class=\"brush: csharp\">\n// открываем первый файл\nSystem.Diagnostics.Process.Start(outputDir + @\"/chars.txt\");\n// открываем второй файл\nSystem.Diagnostics.Process.Start(outputDir + @\"/words.txt\");\n</pre>\nЕсли в качестве стандартного приложения для работы с *.txt файлами у вас стоит блокнот,\nто у вас должно открыться два блокнота.\n<div class=\"note\">\nкстати <b>System.Diagnostics.Process</b> на самом деле просто класс <b>Process</b> для управления процессами операционной системы, если б мы подключили вверху программы пространство имен <b>System.Diagnostics</b>, можно было написать и так:\n<pre class=\"brush: csharp\">\n...\nusing System.Diagnostics;\n...\n\n// открываем первый файл\nProcess.Start(outputDir + @\"/chars.txt\");\n// открываем второй файл\nProcess.Start(outputDir + @\"/words.txt\");\n</pre>\n</div>\n<p>\nНу и напоследок дадим рассмотреть пользователю чего у нас на консоль выведено:\n<pre class=\"brush: csharp\">\n// приостановка, в ожидании нажатия пользователем любой клавиши\nConsole.ReadKey();\n</pre>\n<hr>\n<h2>Полный листинг</h2>\n<pre class=\"brush: csharp\">\nusing System;\nusing System.Text;\nusing System.IO;\nusing System.Collections.Generic;\nusing System.Linq;\n\nnamespace ConsoleApplication1\n{\n	class MainClass\n	{\n		public static void Main (string[] args)\n		{\n			String inputFile = args [0];\n			String outputDir = args [1];\n\n			if (!File.Exists (inputFile)) \n			{\n				Console.WriteLine (\"файла \\\"\" + inputFile + \"\\\" не существует!\");\n				Console.ReadKey ();\n				return;\n			}\n\n			String fullText = File.ReadAllText (inputFile, Encoding.GetEncoding (1251));\n			Console.WriteLine (fullText);\n\n			Char[] separators = {\' \', \',\', \'.\', \'-\', \'\\n\', \'!\', \'?\', \'\\\"\', \'\\r\' };\n			String[] wordsArray = fullText.Split (separators, StringSplitOptions.RemoveEmptyEntries);\n\n			var dictWords = new Dictionary<string, int> ();\n			foreach (var word in wordsArray) \n			{\n				if (!dictWords.ContainsKey (word)) \n				{\n					dictWords.Add (word, 1);\n				} \n				else \n				{\n					dictWords [word] += 1;\n				}\n			}\n\n			StreamWriter writer = new  StreamWriter (outputDir + @\"\\words.txt\");\n\n			foreach (var pair in dictWords.OrderBy( x => x.Value )) \n			{\n				writer.WriteLine (\"{0,-14}: {1}\", pair.Key, pair.Value);\n			}\n			writer.Close ();\n\n			var dictChars = new Dictionary<Char, int> ();\n			foreach (Char ch in fullText) \n			{\n				if (Char.IsLetter (ch)) \n				{\n				\n	if (dictChars.ContainsKey (ch)) \n					{\n						dictChars [ch] += 1;\n					} \n					else \n					{\n						dictChars.Add (ch, 1);\n					}\n				}\n			}\n\n			StringBuilder outString = new StringBuilder ();\n			foreach (var pair in dictChars.OrderBy( x => x.Value ) ) \n			{\n				double freq = (double) pair.Value / fullText.Length;\n				outString.AppendFormat(\"{0,-3}: {1:0.000%}\", pair.Key, freq);\n				outString.AppendLine();\n			}\n			File.WriteAllText(outputDir + @\"\\chars.txt\" ,outString.ToString());\n\n			System.Diagnostics.Process.Start(outputDir + @\"\\chars.txt\");\n			System.Diagnostics.Process.Start(outputDir + @\"\\words.txt\");\n\n			Console.ReadKey();\n		}\n	}\n}\n</pre>',1,3,0,194,0,1391936777),(5,'Формы','Формы','Формы','',2,'\nnotextile.. \nСоздадим <b>Windows Form Application</b>. Для этого выбираем <b>Файл / Создать / Проект</b>,\nи в качестве шаблона указываем <b>Приложение Windows Forms</b>.\nВ реультате увидим примерно следующую картинку:\n<img  class=\"img-small\" src=\"images/csharp-04-01.png\" />\nЕсли у вас вдруг отсутствует левая (<b>панель элементов (toolbox)</b>) или правая панелька (<b>свойства (properties)</b>),\nих можно включить через меню <b>Вид (view)</b>\n<p>\nДобавим на форму пару элементов, пока нам хватит <b>Button</b> и <b>RichTextBox</b>. Чтобы добавить компонент его надо\nперетянуть с панели инструментов на форму. Должно получиться что-то в этом роде:\n<img  class=\"img-small\" src=\"images/csharp-04-02.png\">\nВыделим кнопку (кликнув на нее один раз), и поменяем ее имя (свойство <b>Name</b>) на <b>btnShowText</b>, \nи надпись на кнопке (свойство <b>Text</b>) на <b>Показать текст</b> \n<img class=\"img-small\" src=\"images/csharp-04-03.png\">\n<div class=\"note\">\nКаждый объект на форме, включаю саму форму, обладает набором свойств, изменяя которые можно изменять\nповедение и вид объекта. Самое простое, но в тоже время самое важное свойства - это свойство <b>Name</b>. \nС помощью него мы обращаемся к объекту. То есть если кнопка имеет имя <b>RedButton</b>, то для\nтого чтобы программно нажать на эту кнопку надо будет написать\n<pre class=\"brush: csharp\">\nRedButton.Click();\n</pre>\nА если нам вдруг захочется узнать какая надпись на кнопке, и присвоить это значение какой-нибудь переменной мы напишем\n<pre class=\"brush: csharp\">\nstring labeltext = RedButton.Text;\n</pre>\n</div>\n<p>\nВыделим объект типа <b>RichTextBox</b> и поменяем его имя на <b>txtMain</b>.<br>\n<b>RichTextBox</b> позволяет отображать форматированный текст и редактировать его. \nЕсли сейчас запустить приложение (<b>F5</b>), то можно написать чего нибудь в текстовом поле,\nможно понажимать на кнопку, правда все это пока не принесет ни какой пользы. \n<p>\nЕсли приложение запущенно, то закроем его и вернемся к редактированию формы. Щелкнем два раза на\nнашу кнопку <b>btnShowText</b>. По идее мы должны оказаться в режиме редактирования кода. Увидим мы примерно следующее:\n\n<pre class=\"brush: csharp\">\n/*\n	В отличие от консольных приложений здесь уже намного \n	больше компонентов подключено по умолчанию.\n	Часть из них предназначена для работы с объектами на форме\n*/\nusing System;\nusing System.Collections.Generic;\nusing System.ComponentModel;\nusing System.Data;\nusing System.Drawing;\nusing System.Linq;\nusing System.Text;\nusing System.Windows.Forms;\n\nnamespace WindowsFormsApplication1\n{ \n    /*\n    	Создавая форму, мы формируем новый объект формы на\n    	базе самой простой, на что и указывает \n    	...  class Form1 : Form ...\n    	\n    	Часто класс формы содержит очень много функций\n    	слово partial, позволяет разбивать код для класса\n    	на несколько подфайлов \n    */  \n    public partial class Form1 : Form\n    {\n        // это конструктор формы, он вызывается всего один раз\n        // когда форма создается в памяти впервые        \n        public Form1()\n        {\n            /*\n            	на самом деле данный файл содержит не весь код формы\n   \n         	часть кода содержится в файле Form1.Designer.cs\n            	метод InitializeComponent описан в том файле, \n            	и код в нем генерируется автоматически\n            	в соответствии с тем какие объекты вы добавляете на форму,\n            	и как меняете их свойства\n            */\n            InitializeComponent();\n        }\n        \n        \n        /*\n        	эта функция возникла автоматически когда мы два раза щелкнули\n        	на кнопку btnShowText, в нем мы пропишем код \n        	который будет запускаться каждый раз \n        	когда во время исполнения программы \n        	на кнопку будут нажимать\n        */  \n        private void btnShowText_Click(object sender, EventArgs e)\n        {\n\n        }\n    }\n}\n</pre>\nНаша кнопка будет показывать текстовое сообщение, в котором будет содержаться текст\nиз <b>txtMain</b>. Для этого <b>.Net</b> предлагает нам класс <b>MessageBox</b>.\n<pre class=\"brush: csharp\">\n...\nprivate void btnShowText_Click(object sender, EventArgs e)\n{\n	// сохраним содержимое текстового поля\n	// в переменную	\n	String textFromTxtMain = txtMain.Text;\n	\n	// покажем значение переменной в окне MessageBox\n	MessageBox.Show(textFromTxtMain);\n}\n...\n</pre>\nЕстественно, чтобы в окне что-то было, это что-то надо ввести в текстовое поле.\nНо каждый раз вводить лень, так что вернемся в режим редактирования формы, и изменим значение\nсвойства <b>Text</b> объекта <b>txtMain</b> например на следующий текст:\n<div class=\"text\">\n Шалтай-Болтай взял книжку и уставился в нее.<br>\n - Кажется, здесь нет ошиб... - начал он.<br>\n - Вы ее держите вверх ногами, - прервала его Алиса.<br>\n - Ну, конечно, - весело заметил Шалтай-Болтай и взял перевернутую Алисой книжку. - То-то я смотрю, как странно все это выглядит! Поэтому я и сказал: \"_Кажется_, здесь нет ошибки!\", - хоть я и не успел разобраться как следует... Значит, так: триста шестьдесят четыре дня в году ты можешь получать подарки на день нерожденья.<br>\n - Совершенно верно, - сказала Алиса.<br>\n - И только _один_ раз на день рожденья! Вот тебе и слава!<br>\n - Я не понимаю, при чем здесь \"слава\"? - спросила Алиса.\n</div>\nЧтобы ввести этот текст, его можно скопировать и нажать на стрелочку справа от имени свойства,\nчто позволит нам работать с многострочным текстом:\n<img class=\"img-small\" src=\"images/csharp-04-04.png\">\nТеперь если запустить приложение, текстовое поле сразу будет содержать текст.\n<p>\nДобавим еще два элемента на форму. \n<ul>\n<li>Добавим кнопку, назовем ее (свойство <b>Name</b>) <b>btnShowLine</b>, и поменяем текст надписи (свойство <b>Text</b>)\nна <b>ПоказатьСтроку</b>.</li>\n<li>Добавим счетчик, назовем его <b>edtLineIndex</b>.\n</ul>\nПолучим что-то в этом роде:\n<img class=\"img-small\" src=\"images/csharp-04-05.png\">\nЩелкнем дважды на кнопку <b>btnShowLine</b> и пропишем обработчик события нажатия на кнопку.\nПо нажатию на эту кнопку должно будет выскакивать <b>MessageBox</b> в котором будет содержаться\nтекст строки из поля <b>txtMain</b> под номером указанным в <b>edtLineIndex</b>.\n<pre class=\"brush: csharp\">\nprivate void btnShowLine_Click(object sender, EventArgs e)\n{\n	// считываем выбранный в edtLineIndex значение	\n	int lineIndex = (int)edtLineIndex.Value;\n	\n	// с помощью свойства Lines объекта txtMain, считываем значение выбранной строки\n	// и сохраняем его в новую переменную\n	string lineText = txtMain.Lines[lineIndex];\n	\n	//выводим значение переменной на экран\n	MessageBox.Show(lineText);\n}\n</pre>\n<div class=\"note\">\nБолее правильно было бы добавить проверку на корректность указанного номера строки,\nвдруг пользователь выберет слишком большое значение. Такая ситуация может привести к\nпадению программы, поэтому правильнее будет написать так:\n<pre class=\"brush: csharp\">\nprivate void btnShowLine_Click(object sender, EventArgs e)\n{\n	// считываем выбранный в edtLineIndex значение	\n	int lineIndex = (int)edtLineIndex.\nValue;\n	\n	// проверяем на допустимость значения индекса строки\n	if ( lineIndex >= 0 && lineIndex < txtMain.Lines.Length)\n	{\n		// с помощью свойства Lines объекта txtMain, считываем значение выбранной строки\n		// и сохраняем его в новую переменную\n		string lineText = txtMain.Lines[lineIndex];\n		\n		//выводим значение переменной на экран\n		MessageBox.Show(lineText);\n	}\n}\n</pre>\n</div>\n<p>\nДобавим еще две кнопки, \n<ul>\n<li>Первую назовем <b>btnHighlightSep</b>, и поменяем ее надпись на <b>знаки</b>. С помощью этой\nкнопки мы сможем подсветить все знаки препинания в поле ввода</li>\n<li>вторую - <b>btnResetColor</b>, и поменяем ее надпись на <b>сбросить</b>.\nС помощью этой кнопки мы сможем снять подсветку текста.</li>\n</ul>\n<img class=\"img-small\" src=\"images/csharp-04-06.png\">\nКак я уже выше упомянул, текстовое поле позволяет форматировать текст, \nт.е. менять цвет, шрифт у подстрок в тексте. Для этого используется функция <b>Select</b>.\nФункция позволяет выделить подстроку в тексте. После того как кусок текста выделен, мы используя свойства вида <b>Selection*</b>\nможем изменять цвета и прочие характеристики выделенного текста.\n<p>\nНапишем обработчик события клика для кнопки <b>btnHighlightSep</b>, для этого как обычно щелкнем на нее дважды.\n\n<pre class=\"brush:csharp\">\nprivate void btnHighlightSep_Click(object sender, EventArgs e)\n{\n	// прощелкиваем счетчик i от 0 до кол-ва символов в тексте	\n	for (int i=0; i < txtMain.TextLength; ++i)\n	{\n		 // если символ на i-ой позиции, является знаком препинания	    \n	    if (Char.IsPunctuation(txtMain.Text[i]))\n	    {\n		    /* \n		  	  выделяем этот символ, функция \n		  	  Select(начальная_позиция_выделения, количество_символов для выделения)       \n		    */ \n	        txtMain.Select(i, 1);\n	        // устанавливаем цвет фона для выделенного текста на желтый \n	        txtMain.SelectionBackColor = Color.Yellow;\n	        // устанавливаем цвет выделенного текста на красный \n	        txtMain.SelectionColor = Color.Red;\n	    }\n	}\n}\n</pre>\nТеперь можно нажать на кнопку и полюбоваться на результат.\n<br>Правда реакция на нажатие кнопки видна только при первом нажатии. Чтобы исправить \nданную ситуация, пропишем кнопке с надписью <b>сбросить</b> обработчик события клика - кликнем на нее дважды.\n<pre class=\"brush: csharp\">\nprivate void btnResetColor_Click(object sender, EventArgs e)\n{\n	// выделяем весь текст	\n	txtMain.SelectAll();\n	\n	// сбрасываем цвет фона выделенного текста на тот что по умолчанию\n	txtMain.SelectionBackColor = txtMain.BackColor;\n	\n	// сбрасываем цвет выделенного текста на тот что по умолчанию\n	txtMain.SelectionColor = txtMain.ForeColor;\n}\n</pre>\n\nДобавим еще одну кнопку, которая, ради смеха, позволит нам разукрасить текст в произвольные цвета.\n<ul>\n<li>Назовем ее <b>btnRandomColor</b>, и сменим ее надпись на <b>Разукрасить буквы</b></li>\n</ul>\n<img class=\"img-small\" src=\"images/csharp-04-07.png\">\nНапишем обработчик события клика для новой кнопки\n<pre class=\"brush: csharp\">\nprivate void btnRandomColor_Click(object sender, EventArgs e)\n{\n	/*\n		создадим новый генератор случайных чисел\n		в соответствии с названием \n		он генерирует случайные числа\n		с помощью функции Next\n	*/	\n	Random rndGen = new Random();\n	\n	// снова пройдем счетчиком i от 0 до кол-ва символов в тексте\n	for (int i = 0; i < txtMain.TextLength; ++i)\n	{\n	    // выделяем i-ый символ	    \n	    txtMain.Select(i, 1);\n	    \n	    /*\n	    	сгенерируем новый цвет,\n	    	цвет состоит из 3-х компонент, \n	    	красной (1-ый параметр), принимаемое значение от 0 до 255\n			зеленый (2-ый параметр), принимаемое значение от 0 до 255\n			синий (3-ый параметр), принимаемое значение от 0 до 255\n			\n			rndGen.Next(256) - сгенерирует случайное число от 0 до 255\n			установив 0 для синей компоненты цвета, мы получим красно-зеленую\n			осеннюю раскраску\n		 */\n	    Color newRandomColor = \nColor.FromArgb(rndGen.Next(256), rndGen.Next(256), 0);\n\n	    // установим цвет выделенного символа на значене ново-сгенерируемого цвета\n	    txtMain.SelectionColor = newRandomColor;\n	}\n}\n</pre>\n\nНу и напоследок. Тут у меня фрагмент текста из книги Алиса в Зазеркалье, я просто\nчувствую себя обязанным чего-нибудь отзеркалить. Я буквы конечно вверх ногами не переверну, но продемонстрирую\nвозможность переноса текста из элемента в другой. Итак, добавим два новых элемента \n<ul>\n<li>Кнопку, назовем ее <b>btnMirror</b>, и подпишем <b>отзеркалить текст</b></li>\n<li>Поле для ввода текста (<b>RichTextBox</b>), и назовем его <b>txtMirrored</b></li>\n</ul>\n<img class=\"img-small\" src=\"images/csharp-04-08.png\">\nПытаясь имитировать зеркало, мы развернем порядок букв в тексте. \nВообще говоря развернуть текст можно следующим трюком:\n<pre class=\"brush: csharp\">\n// формируем массив символов из строки\nchar[] charsArray = txtMain.Text.ToCharArray();\n// инвертируем массив символов\nArray.Reverse(charsArray);\n// формируем новую строку на основе инвертированного массива символов\ntxtMirrored.Text = new String(charsArray);\n</pre>\nНо нам кроме инвертирования самого текста хотелось бы еще сохранить и цвет, соответствующих символов, \nдля этого реализуем посимвольную раскраску текста. Пропишем обработчик события клика для кнопки <b>btnMirror</b>\n<pre class=\"brush: csharp\">\nprivate void btnMirror_Click(object sender, EventArgs e)\n{\n	// скопируем инвертированный текст из 	txtMain в txtMirrored\n	char[] charsArray = txtMain.Text.ToCharArray();\n	Array.Reverse(charsArray);\n	txtMirrored.Text = new String(charsArray);\n	\n	// пройдем счетчиком i от 0 до кол-ва символов в тексте txtMain\n	for (int i = 0; i < txtMain.TextLength; ++i)\n	{\n		 // выделяем текст в txtMirrored    \n	    txtMirrored.Select(i, 1);\n	    /*\n	    	выделяем соответствующий символ в txtMain;\n	    	напоминаю, что текст у нас развернут\n	    	и первый символ txtMirrored соответствует \n	    	последнему символу txtMain\n	    */\n	    txtMain.Select(txtMain.TextLength - i -1, 1);\n	    \n	    // копируем значения соответствующих цветов\n	    txtMirrored.SelectionColor = txtMain.SelectionColor;\n	    txtMirrored.SelectionBackColor = txtMain.SelectionBackColor;\n	}\n}\n</pre>\nСтоит отметить что посимвольное копирование цвета ОООООЧЕНЬ медленное, и если \nвы вдруг закинули в поле для текста какой-нибудь (пусть даже небольшой рассказик),\nто самым разумным будет нажать <b>Shift+F5</b>\n<div class=\"note\">\nКстати, если вы хотите наглядно видеть как происходит процесс перекраски текста, добавьте следующую\nстрочку в тело цикла:\n<pre class=\"brush: csharp\">\n	 ...\n    txtMirrored.SelectionColor = txtMain.SelectionColor;\n    txtMirrored.SelectionBackColor = txtMain.SelectionBackColor;\n	  \n	 /*\n	 	с помощью этой строчки на каждой итерации цикла,\n	 	txtMirrored будет перерисовывать себя,\n	 	(в общем случае обрабатывать сообщения от операционной системы)\n	 	это сильно замедлит программу \n	 	но зато добавит в нее вау-эффект\n	 */\n    Application.DoEvents();\n}\n</pre>\n</div>\n<hr>\n<h2>Полный листинг:</h2>\nВ отличие от консольных приложений здесь недостаточно будет\nпросто скопировать текст в редактор текста <b>Visual Studio</b>,\nтут таки придется еще и нарисовать форму, и правильно назвать все компоненты.\n\np. \n\npre(brush:csharp).. \nusing System;\nusing System.Collections.Generic;\nusing System.ComponentModel;\nusing System.Data;\nusing System.Drawing;\nusing System.Linq;\nusing System.Text;\nusing System.Windows.Forms;\n\nnamespace WindowsFormsApplication1\n{\n    public partial class Form1 : Form\n    {\n        public Form1()\n        {\n            InitializeComponent();\n        }\n\n        private void btnShowText_Click(object sender, EventArgs e)\n        {\n            String textFromTxtMain = txtMain.Text;\n            MessageBox.Show(\ntextFromTxtMain);\n        }\n\n        private void btnShowLine_Click(object sender, EventArgs e)\n        {\n            int lineIndex = (int)edtLineIndex.Value;\n            String lineText = txtMain.Lines[lineIndex];\n            MessageBox.Show(lineText);\n        }\n\n        private void btnHighlightSep_Click(object sender, EventArgs e)\n        {\n            for (int i=0; i<txtMain.TextLength; ++i)\n            {\n                if (Char.IsPunctuation(txtMain.Text[i]))\n                {\n                    txtMain.Select(i, 1);\n                    txtMain.SelectionBackColor = Color.Yellow;\n                    txtMain.SelectionColor = Color.Red;\n                }\n            }\n        }\n\n        private void btnResetColor_Click(object sender, EventArgs e)\n        {\n            txtMain.SelectAll();\n            txtMain.SelectionBackColor = txtMain.BackColor;\n            txtMain.SelectionColor = txtMain.ForeColor;\n        }\n\n        private void btnRandomColor_Click(object sender, EventArgs e)\n        {\n            Random rndGen = new Random();\n            for (int i = 0; i < txtMain.TextLength; ++i)\n            {\n                txtMain.Select(i, 1);\n                Color newRandomColor\n                    = Color.FromArgb(rndGen.Next(256), rndGen.Next(256), 0);\n                txtMain.SelectionColor = newRandomColor;\n            }\n        }\n\n        private void btnMirror_Click(object sender, EventArgs e)\n        {\n            char[] charsArray = txtMain.Text.ToCharArray();\n            Array.Reverse(charsArray);\n            txtMirrored.Text = new String(charsArray);\n            for (int i = 0; i < txtMain.TextLength; ++i)\n            {\n                txtMirrored.Select(i, 1);\n                txtMain.Select(txtMain.TextLength - i -1, 1);\n                txtMirrored.SelectionColor = txtMain.SelectionColor;\n                txtMirrored.SelectionBackColor = txtMain.SelectionBackColor;\n\n                Application.DoEvents();\n            }\n            \n        }\n    }\n}\n\np. ',1,4,0,106,0,1391872747),(7,'','&#9679;','Чаинка','',11,'\nnotextile.. \n<style>\n.mainImage {\nborder: 2px solid #000055;\npadding-top:0px;\nmargin-top:0px;\n}\n</style>\n\np=. !(mainImage)images/expedition.gif!\n ',0,0,1,95,0,1392055093),(28,'Чаинка','Чаинка - зимняя','Чаинка - зимняя','',13,'\nnotextile.. \n<style>\n.mainImage {\nborder: 2px solid #000055;\npadding-top:0px;\nmargin-top:0px;\n}\n</style>\n\np=. !(mainImage)images/expedition.gif!\n ',0,1,0,10,1391974180,1391975472),(9,'Вопросы к первому коллоквиуму','Вопросы к первому коллоквиуму','Вопросы к первому коллоквиуму','',4,'#(tasks) Множества (пустое множество,  подмножество, операции над множествами, парадокс Рассела, теорема о мощности булеана множества).\n# Отношения (свойства бинарных, эквивалентность отношений и функций).\n# Отношение эквивалентности (свойства, разбиение на классы эквивалентности).\n# Пропозициональные связки. Таблицы истинности. Формулы.\n# Тавтологии. Противоречия.\n# Полные системы связок (примеры полных систем состоящих из 2-х связок, из 1-ой связки).\n# Аксиоматическая теория L (определение, аксиомы).\n# Вывод в формулах исчисления высказываний (ФИВ).\n# Теорема дедукции в ФИВ.',0,1,0,76,0,1393341855),(10,'Список лабораторных заданий','&nbsp;&#9679; Лабораторные','Список лабораторных заданий','',2,'<div class=\"lab\"><h2 class=\"title\"><a>#1. Анализ текста</a></h2><div class=\"info\">Текст для каждой задачи необходим прочитать из файла. Файл с текстом вы вольны выбрать сами. Текст должен быть на русском языке и содержать не менее 1000 символов и исключать возможность пустых ответов. Под результат необходимо создать новый файл, и записать в него ответ.\n  \n#(tasks) \n#(easy) Найти слова в которых четное кол-во букв. В качества ответа предоставить список слов. Рассчитать долю таких слов относительно всех слов\n#(easy) Найти слова которые не содержат букву введенную с клавиатуры. Рассчитать долю таких слов относительно всех слов.\n#(easy) Найти слова в которых первая буква совпадает с последней. Рассчитать долю таких слов относительно всех слов.\n#(easy) Найти слова длина которых меньше числа введенного с клавиатуры. Рассчитать долю таких слов относительно всех слов. \n#(easy) Найти предложения содержащие четное кол-во слов. Рассчитать долю таких предложений относительно всех предложений.\n#(easy) Найти в тексте слова перевертыши. Рассчитать их долю относительно всех слов.\n#(easy) Найти предложение содержащее наибольшее кол-во слов.\n#(easy) Найти строку содержащую наибольшее кол-во предложений.\n#(easy) Найти слова около которых встречаются знаки препинания. Рассчитать долю таких слов относительно всех слов.\n#(medium) Выяснить слова какой длины встречаются наибольшее кол-во раз в тексте.    Рассчитать долю таких слов относительно всех слов.\n#(medium) Удалить из текста все гласные.\n#(medium) Удалить из текста все согласные.\n#(medium) Найти слова которые не содержат одинаковых букв. Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти слова в которых встречаются сдвоенные согласные. Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти слова в которых одна и та же буква встречается более чем два раза. Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти слова которые содержат нечетное кол-во гласных.    Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти слова в которых гласных букв неменьше согласных. Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти предложения, в которых согласных не менее чем в два раза больше чем гласных.    Рассчитать их долю относительно всех слов.\n#(medium) Найти слова в которых встречаются сдвоенные гласные. Рассчитать долю таких слов относительно всех слов.\n#(hard) Подсчитать сколько слогов содержит каждая строка. Если кол-во слогов в строках чередуется (например 8-7-8-7), сообщить об этом в файле отдельной строкой. В качестве текста рекомендуется использовать стих (правило 1000 символов отменяется).\n#(nightmare) Найти прилагательные в тексте. Рассчитать их долю относительно всех слов.\n#(nightmare) Найти имена в тексте. Рассчитать их долю относительно всех слов.\n\n</div></div><div class=\"lab\"><h2 class=\"title\"><a>#2. Регулярные выражения</a></h2><div class=\"info\"> Для данного задания все операции поиска и разбиения необходимо производить с помощью регулярных выражений. Текст для обработки необходим прочитать из файла. Текст должен быть на русском языке и содержать не менее 1000 символов и исключать возможность пустых ответов. Под результат необходимо создать новый файл, и записать в него ответ.\n\n#(tasks) \n#(easy) Найти слова в которых встречаются более трех подряд идущих согласных (нпр: <b>стр</b>аница). Рассчитать долю таких слов относительно всех слов.\n#(easy) Найти в тексте даты вида дд.мм.гггг (например 13.10.2013). Исходить из предположения что\nвсе даты в тексте валидные (т.е. нет таких 32.13.2201). Рассчитать долю таких последовательностей\nотносительно всех цифровых последовательностей.\n#(easy) Найти в тексте слова оканчивающиеся на несколько подряд идущих гласных (напр: вкусн<b>ое</b>). Рассчитать долю таких слов относительно всех слов.\n#(easy) Найти в тексте слова длины заданной пользователем, и рассчитать их долю относительно всех слов.\n#(easy) Найти в тексте слова с дефисом. Рассчитать их долю относительно всех слов.\n#(easy) Найти в тексте слова содержащие не более одного дефиса. Рассчитать долю таких слов относительно всех слов.\n#(easy) Найти в тексте цитаты\n#(easy) Найти в тексте все IP-адреса. Исходить из предположения что все IP-адреса в тексте валидные. \nРассчитать долю таких числовых последовательностей относительное всех числовых последовательностей.\n#(easy) Найти в тексте вопросительные и восклицательные предложения. Рассчитать долю таких предложений относительно всех предложений.\n#(medium) Найти в тексте слова стоящие на начале и в конце предложений\n#(medium) Найти в тексте слова содержащие четное кол-во букв. Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти в тексте слова содержащие нечетное кол-во цифр. Рассчитать долю таких слов относительно всех слов.\n#(medium) Найти в тексте мобильные номера телефонов, с учетом возможности наличия черточек \n(нпр: <b>1 234 567 89 12</b>, <b>12345678912</b>, <b>+1 234 567 89 12</b>, <b>1-234-567-89-12</b>). Рассчитать долю таких последовательностей относительно всех цифровых последовательностей.\n#(medium) Найти в тексте цифры от <b>1</b> до <b>99</b> (01, 02 и т.п. не считаются за цифры). Рассчитать долю таких цифровых последовательностей относительно всех цифровых последовательностей.\n#(medium) Найти в тексте предложения содержащие знаки препинания. Рассчитать долю таких предложений относительно всех предложений\n#(medium) Найти в тексте предложения содержащие не меньше n слов. Рассчитать долю таких предложений относительно всех предложений\n#(hard) Найти в тексте пары слов в которых последняя буква первого совпадает с первой буквой второго слова. Рассчитать долю таких слов относительно всех слов.\n#(hard) Найти в тексте слова содержащие две подряд идущие одинаковые буквы. Рассчитать долю таких слов относительно всех слов.\n#(hard) Найти в тексте слова повторяющиеся два раза подряд. Рассчитать долю таких слов относительно всех слов.\n#(hard) Найти предложения в которых встречаются повторяющиеся слова. Рассчитать долю таких предложений относительно всех предложений.\n#(nightmare) Найти в тексте даты вида дд.мм.гггг (например 13.10.2013). Некорректные даты не должны войти в результат поиска (т.е. 32.13.2201 не подходит). Исходить из предположения что в каждом месяце 30 дней.\n\n</div></div><div class=\"lab\"><h2 class=\"title\"><a>#3. Отчеты. Часть первая</a></h2><div class=\"info\"> Создать *три* html документа. Каждый html-документ, должен содержать:\n# не менее одного простого списка (как минимум *3* элемента)\n# не менее одного нумерованного списка (как минимум *3* элемента)\n# не менее одной таблицы (как минимум *2* строки *2* столбца)\n# не менее одного заголовка\n# не менее одной картинки из локального источника\n# ссылки на соседние документы\n# ссылку на любой внешний ресурс\n\nИнформация на странице может быть любая. Но не такая как у соседа >:O\n\nТаким образом вы должны предоставить мне как минимум *6* файлов, примерно следующей структуры:\n\n!(img-small)images/image_html_sample3.png! \n\n</div></div><div class=\"lab\"><h2 class=\"title\"><a>#3¼. Отчеты. Часть вторая</a></h2><div class=\"info\"> В каждом из заданий необходимо прочитать данные из файла, создать собственный объект @struct SomeObjectName@, обладающий свойствами, которые отвечают строкам в файле. Создать список типа @List<SomeObjectName>@. Заполнить его данными из файла. Обработать список в соответствии с заданием, и сохранить результат в новый файл.\n\n#(tasks) \n#(easy) Найти актеров, которые начали свою карьеру актера после 20 лет. Результат упорядочить по фамилии.\nфайл: \"actors.txt\":files/data/actors.txt\n#(easy) Найти модели самолетов, которые в среднем выпускались не менее 100 штук в год. Результат упорядочить по названи концерна.\nфайл: \"airplanes.txt\":files/data/airplanes.txt\n#(easy) Найти вулканы извергающиеся до начала нашей эры и высотой больше 1000м. Результат упорядочить по названию.\nфайл: \"volcano.txt\":files/data/volcano.txt\n#(easy) Найти озера максимальная глубина которых превышает среднюю более чем в два раза. Результат упорядочить по названию.\nфайл: \"lakes.txt\":files/data/lakes.txt\n#(easy) Найти вулканы извергающиеся хотя бы раз за последние сто лет и находящиеся на высоте более 5000м. Результат упорядочить по названию.\nфайл: \"volcano.txt\":files/data/volcano.txt\n#(easy) Найти фильмы выпущенные под новый год в период с 1990 по 2000 г. Результат упорядочить по названию.\nфайл: \"movies.txt\":files/data/movies.txt\n#(easy) Найти озера, дно которых находится ниже уровня моря. Результат упорядочить по названию.\nфайл: \"lakes.txt\":files/data/lakes.txt\n#(medium) Для каждого конкретного концерна, найти наиболее успешную модель самолета. Результат упорядочить по названию коцерна.\nфайл: \"airplanes.txt\":files/data/airplanes.txt\n#(medium) Для каждого конкретного года, найти группу с наибольшим составом. Результат упорядочить по году.\nфайл: \"bands.txt\":files/data/bands.txt\n#(medium) Для каждого конкретной страны, найти автомобиль с наибольшим количеством передач. Результат упорядочить по названию страны.\nфайл: \"automobiles.txt\":files/data/automobiles.txt\n#(medium) Для каждого конкретного года, найти книгу содержащую наибольшее кол-во страниц. Результат упорядочить по году.\nфайл: \"books.txt\":files/data/books.txt\n#(medium) Для каждого конкретного созвездия, найти наиболее близкую к земле галактику. Результат упорядочить по названию созвездия.\nфайл: \"galaxy.txt\":files/data/galaxy.txt\n#(medium) Для каждого конкретного года, найти игру получившую наивысшую оценку. Результат упорядочить по году.\nфайл: \"games.txt\":files/data/games.txt\n#(medium) Найти самый высокий вулкан извергающийся в каждом конкретном году. Результат упорядочить по году.\nфайл: \"volcano.txt\":files/data/volcano.txt\n\n</div></div><div class=\"lab\" ><h2 class=\"title\"><a>#5. Последнее</a></h2><div class=\"info\">Доработать программу @#3¼@. Реализовать сохранение результатов программы в html-файл с использованием системы шаблонов. \n\nСоздать не менее двух шаблонов (один отображает результат в виде списка, и один -- в виде таблицы). \n\nКаждый шаблон должен выводить все доступные свойства для вашего объекта (т.е., если у вас актер -- то, если выводим список, каждый элемент списка содержит @имя@, @фамилию@, @дату рождения@ и т.д.).\n\nТаки образом, мне от вас надо: программу, два файла шаблонов и два html-файла с результатами.\n\nnotextile. </div></div>',1,0,0,608,0,1392117680),(11,'Регулярные выражения. Часть 1','Регулярные выражения. Часть 1','Регулярные выражения. Часть 1','',2,'\nnotextile.. \nНаверное вам хоть раз да приходилось файл в папке, удовлетворяющий\nмаске поиска типа <b>*.txt</b>. Такая форма записи позволяла найти всем файлы\nс расширением <b>txt</b>, возможно вы даже применяли что-то подобное при поиске по тексту.\nТак вот, регулярное выражение представляет из себя подобие такой маски, но с куда более широкими\nвозможностями.\n<p>\nЯ буду выделять регулярное выражение <span style=\"font-size:1.5em; color:#08E\">голубым</span> цветом.<br>\nПоследовательности символов удовлетворяющие регулярному выражению выделю <span style=\"background-color: yellow\">так</span> либо <span style=\"background-color: #BF0\">так</span>.<p>\nРассмотрим простейшее регулярное выражение состоящие из трех символов <b>к</b>, <b>о</b> и <b>т</b>.\nТо бишь просто слово <b>кот</b>.<br> \n<div class=\"regex\">\n<dt>кот</dt>\n<dd><b>кот</b>-окто<b>кот</b> киткоооткат толчет в <b>кот</b>ле мак</dd>\n</div>\n\nВ слове <b>киткоооткат</b>, то же имеется слово кот, только оно вместе одной буквы <b>о</b> содержит\nцелых <b>три</b>. Мы можем легко добавить к результату поиска и это слово если перепишем регулярное выражение\nследующим образом\n\n<div class=\"regex\">\n<dt>ко+т</dt>\n<dd><b>кот</b>-окто<b>кот</b> кит<b>кооот</b>кат толчет в <b>кот</b>ле мак</dd>\n</div>\n\nДанное выражение можно прочитать как найти все подстроки начинающихся с <b>к</b>,\nза которой следует одна или более буква <b>о</b>, и которая заканчивается буквой <b>т</b>.\n<p>\nЗнак <b>+</b> после символа означает что символ может встречаться один и более раз.\nБывают ситуации когда присутствие или отсутствие символа не столь важно, для этого\nнам предлагают использовать символ <b>*</b>. Вот как поведет себя поиск если мы заменим <b>+</b> на <b>*</b>\n\n<div class=\"regex\">\n<dt>ко*т</dt>\n<dd><b>кот</b>-о<b>кт</b>о<b>кот</b> кит<b>кооот</b>кат толчет в <b>кот</b>ле мак</dd>\n</div>\nТут у нас добавилась подстрока <b>кт</b>, которая начинается на <b>к</b>, заканчивается на <b>т</b>\nно не содержит букву <b>о</b>.\n<p>\nЕсли важно найти \"котов\" содержащие не более одной буквы <b>о</b>, то нужно использовать знак <b>?</b>  \n<div class=\"regex\">\n<dt>ко?т</dt>\n<dd><b>кот</b>-о<b>кт</b>о<b>кот</b> киткоооткат толчет в <b>кот</b>ле мак</dd>\n</div>\nЕсли же нам хочется указать какое-то конкретное кол-во повторений того или иного символа,\nмы можем указать значение к фигурных скобках.\n<div class=\"regex\">\n<dt>ко{3}т</dt>\n<dd>кот коот <b>кооот</b> коооот коооооот</dd>\n</div>\nНе меньше 3-х раз:\n<div class=\"regex\">\n<dt>ко{3,}т</dt>\n<dd>кот коот <b>кооот</b> <b>коооот</b> <b>коооооот</b></dd>\n</div>\nНе больше 3-х раз:\n<div class=\"regex\">\n<dt>ко{,3}т</dt>\n<dd><b>кот</b> <b>коот</b> <b>кооот</b> коооот коооооот </dd>\n</div>\nОт 3-х до 5-ти:\n<div class=\"regex\">\n<dt>ко{3,5}т</dt>\n<dd>кот коот <b>кооот</b> <b>коооот</b> коооооот </dd>\n</div>\n\nА что если нам хочется найти не только \"котов\" но и \"китов\" и \"катов\", а может даже и \"кытов\".\nДля таких случаев в квадратных скобах можно указать какие именно буквы могут находится\nмежду <b>к</b> и <b>т</b> \n<div class=\"regex\">\n<dt>к[оаыи]т</dt>\n<dd><b>кот</b>-окто<b>кот</b> <b>кит</b>кооот<b>кат</b> толчет в <b>кот</b>ле мак</dd>\n</div>\nАльтернативный вариант вместо фигурных скобок использовать прямую черту\n<div class=\"regex\">\n<dt>к(о|а|ы|и)т</dt>\n<dd><b>кот</b>-окто<b>кот</b> <b>кит</b>кооот<b>кат</b> толчет в <b>кот</b>ле мак</dd>\n</div>\nДостоинство <b>|</b> заключается в том что позволяет указывать в качестве вариантов целый слова\nнапример:\n<div class=\"regex\">\n<dt>к(о|ро|апо|и)т</dt>\n<dd>Такое регулярное выражение будет искать в тексте слова: <b>кот</b>, <b>крот</b>, <b>капот</b> и <b>кит</b></dd>\n</div>\n\nЧего-то я отвлекся. Снова пропал наш \"кооот\". Чтоы вернуть его надо разрешить повторения в регулярном выражении\n<div class=\"regex\">\n<dt>к[оаыи]+т</dt>\n<dd><b>кот</b>-окто<b>кот</b> <b>кит</b><b><i>кооот</i></b><b>кат</b> толчет в <b>кот</b>ле мак</dd>\n</div>\n\nА если нас устроят всякие \"к-ты\", какая бы буква не была между <b>к</b> и <b>т</b>. Конечно можно в ручную\nпрописать все буквы, но можно сделать проще - указав допустимый диапазон букв\n<div class=\"regex\">\n<dt>к[а-я]+т</dt>\n<dd><b>кот</b>-окто<b>кот</b> <b>кит</b><b><i>кооот</i></b><b>кат</b> толчет в <b>кот</b>ле мак</dd>\n</div>\n\nЛибо еще проще, если использовать класс <b>\\w</b> (с маленькой буквы) - который соответствует всякой букве или цифре.\nНе совсем правильно решение в данной ситуации (начнут вылезать всякие <b>к0ты</b>, <b>к1ро23ты</b>, <b>к_ты</b>, <b>к666ты</b> и прочая нечисть),\nно для учебных целей сойдет.\n<div class=\"regex\">\n<dt>к\\w+т</dt>\n<dd><b>кот</b>-окто<b>кот</b> <b>кит</b><b><i>кооот</i></b><b>кат</b> толчет в <b>кот</b>ле мак</dd>\n</div>\n\nОчень часто, нам не будут интересовать различные вариации \"котов\", и нам захочется найти\nобыкновенного няшного кота. Как помним использование в качестве регулярного\nвыражения \"кот\" находило нам не только котов но и элементы котлов\nи октокотов. И если второе еще можно принять за кота, \nто котел уж совсем не кот. Проще говоря мы хотим найти просто слово \"кот\".\nДля таких целей регулярные выражения предлагают нам символ границы слова <b>\\b</b>. \nЧто найти точно слово \"кот\" можно использовать следующее выражение.\n<div class=\"regex\">\n<dt>\\bкот\\b</dt>\n<dd><b>кот</b>-октокот киткоооткат толчет в котле мак</dd>\n</div>\n\nАга! Теперь мы можем найти слова содержащие котов на правой границы слова\n<div class=\"regex\">\n<dt>\\w*кот\\b</dt>\n<dd><b>кот</b>-<b>октокот</b> киткоооткат толчет в котле мак</dd>\n</div>\nИли на левой\n<div class=\"regex\">\n<dt>\\bкот\\w*</dt>\n<dd><b>кот</b>-октокот киткоооткат толчет в <b>котле</b> мак</dd>\n</div>\nЕсли не хотите включать слово \"кот\" в результат поиска, замените <b>*</b> на <b>+</b>.\n<p>\nОчевидно что на котах далеко не уедешь, и часто приходится искать более абстрактные вещи, например \nможет возникнуть необходимость просто найти все слова в тексте. На предыдущих занятиях\nприходилось использовать б-гомерзкий <b>Split()</b>. Теперь же у нас есть регулярные\nвыражения. Для того чтобы найти все слова подойдет такое выражение:\n<div class=\"regex\">\n<dt>[А-Яа-я]+</dt>\n</div>\nПо умолчанию регулярные выражения являются регистро-зависимыми, поэтому приходится\nявно указывать строчные и прописные буквы. Если нужны еще и английские буквы то так\n<div class=\"regex\">\n<dt>[A-Za-zА-Яа-я]+</dt>\n</div>\nКонечно можно использовать и класс <b>\\w</b>, но тогда к поиску добавятся еще и последовательности\nсодержащие цифры и подчеркивание <b>_</b>. То есть например так\n<div class=\"regex\">\n<dt>\\w+</dt>\n<dd>Будет находить все последовательности символов содержащие исключительно\n<b>буквы</b>, <b>цифры</b> и <b>знак подчеркивания</b></dd>\n</div>\nЕсли вам нужны только цифры то можно использовать класс <b>\\d</b>:\n<div class=\"regex\">\n<dt>\\d+</dt>\n<dd>Мне <b>15</b> лет, а мой IP <b>255</b>.<b>255</b>.<b>255</b>.<b>0</b></dd>\n</div>\nКстати, если указать в качестве регулярного выражения <b>\\w</b> без <b>*</b> или <b>+</b>\nполучим список всех букв, цифр и знаков подчеркиваний\n<div class=\"regex\">\n<dt>\\w</dt>\n<dd><b>к</b><i>о</i><b>т</b>-<i>о</i><b>к</b><i>т</i><b>о</b><i>к</i><b>о</b><i>т</i> <b>к</b><i>и</i><b>т</b><i>к</i><b>о</b><i>о</i><b>о</b><i>т</i><b>к</b><i>а</i><b>т</b> <i>т</i><b>о</b><i>л</i><b>ч</b><i>е</i><b>т</b> <i>в</i> <b>к</b><i>о</i><b>т</b><i>л</i><b>е</b> <i>м</i><b>а</b><i>к</i></dd>\n</div>\n<p>\nМожет потребоваться найти все разделительные символы (пробелы, табуляции, переходы на новую строку и т.д).\nДля этого можно использовать класс <b>\\s</b>\n<div class=\"regex\">\n<dt>\\s+</dt>\n<dd>кот-октокот<b> </b>киткоооткат<b> </b>толчет<b> </b>в<b> </b>котле<b> </b>мак</dd>\n</div>\nПрошу обратить внимания что знаки препинания не считаются за разделители.\nЕсли вам очень уж захочется пересчитать все разделители, включая знаки препинания\nбоюсь что придется перечислить их все в скобках. Примерно так:\n<div class=\"regex\">\n<dt>[\\s,.;:?!]+</dt>\n<dd>кот<b>-</b>октокот<b> </b>киткоооткат<b> </b>толчет<b> </b>в<b> </b>котле<b> </b>мак</dd>\n</div>\nСначала я указываю класс всех пробельных разделителей, а потом дополняю его знаками препинания.\nЛибо если использовать класс обратный для класса <b>\\w</b>. Обратный класс пишется с заглавной буквы <b>\\W</b>:\n<div class=\"regex\">\n<dt>\\W+</dt>\n<dd>кот<b>-</b>октокот<b> </b>киткоооткат<b> </b>толчет<b> </b>в<b> </b>котле<b> </b>мак</dd>\n</div>\n<p>\nА что если возникает ситуация когда надо найти любую последовательность символов, будь то\nпробелы буквы или что-то еще. Тут нам на помощь приходит символ <b>.</b> (\nточка, соответствует любому символу). Например следующее выражение \nсоответствует всему тексту:\n<div class=\"regex\">\n<dt>.*</dt>\n<dd><b>кот-октокот киткоооткат толчет в котле мак</b></dd>\n</div>\nА если нам хочется найти все последовательности находящиеся между двумя <b>т</b>:\n<div class=\"regex\">\n<dt>т.*т</dt>\n<dd>ко<b>т-октокот киткоооткат толчет в кот</b>ле мак</dd>\n</div>\nO__o? Чего-то много выделил. Ну уж точно не точно то, что я хотел.\nЭто называется жадностью, символы <b>+</b>, <b>*</b> при добавлении их после того или иного \nэлемента пытаются сформировать строку наибольшей длины соответствующей шаблону, часто\nэто приводит к неправильным результатом, чтобы избавить плюсик и звездочку от жадности,\nнадо добавлять после них знак вопроса. Вот так:\n<div class=\"regex\">\n<dt>т.*?т</dt>\n<dd>ко<b>т-окт</b>око<b>т кит</b>кооо<b>ткат</b> <b>толчет</b> в котле мак</dd>\n</div>\nНу и наверное последнее что стоит отметить, что если вам вдруг захочется найти в тексте\nсимвол <b>*</b>, <b>+</b> или точку (<b>.</b>). Такие символы придется проэкранировать, путем добавления обратного \nслеша перед символом. Следующий пример находит в тексте все точки:\n<div class=\"regex\">\n<dt>\\.+</dt>\n<dd>Вечереет<b>...</b> вот<b>.</b> и все<b>.</b></dd>\n</div>\n<hr>\n<h2>Регулярные выражения в C#	</h2>\nВ следующем консольном приложении регулярные выражения используются чтобы найти \nв тексте все слова начинающиеся на букву <b>a</b>.\n<pre class=\"brush: csharp\">\nusing System;\nusing System.Collections.Generic;\nusing System.Text;\n\n// необходимо для считывания текста из файла\nusing System.IO; \n\n// необходимо для использования регулярных выражений\nusing System.Text.RegularExpressions; \n\nnamespace ConsoleApplication1\n{\n    class Program\n    {\n      static void Main (string[] args)\n		{\n		   /*\n		   	считываем текст из файла, и сохраняем его в переменную text,\n		   	Encoding.GetEncoding (1251) - использую чтобы явно указать кодировку,\n		   	в большинстве случаев, можно использовать просто Encoding.Default\n		   */			\n			string text = File.ReadAllText(\n				@\"C:\\Алиса в Зазеркалье.txt\",\n				Encoding.GetEncoding (1251)\n				);\n\n			/*\n			  Создаем регулярное выражения \n			  \\bА\\w+\n			  очевидно, оно распознает все слова начинающиеся на A\n			  \n			  устанавливаю флаг RegexOptions.IgnoreCase, \n			  чтобы не учитывать регистр букв			  \n			*/\n			Regex regEx = new Regex (@\"\\bА\\w+\", RegexOptions.IgnoreCase);\n			\n			/*\n			  Использую функцию Matches выше созданного регулярного выражения\n			  которая ищет в тексте последовательности символов \n			  удовлетворяющие регэкспу, \n			  и возвращает их в виде коллекции объектов типа Match \n			*/\n			MatchCollection matches = regEx.Matches (text);\n\n			/*\n			  Вывожу на экран все найденные слова (естественно, с повторениями).\n			  \n			  Стоит отметить что тип Match не просто строка, но также содержит \n			  информацию о расположении слова в тексте, его длине и некоторые\n			  другие плюшки.\n			*/\n			foreach (Match m in matches) \n			{\n				/*\n					напомню, что {0} заменяется на первый параметр \n					идущий после строки формата\n				*/\n				Console.WriteLine(\"Нашел на позиции {0}\", m.Index);\n				Console.WriteLine(\"слово \'{0}\'\", m.Value);\n			}\n        }\n    }\n}\n</pre>',1,5,0,176,0,1392042697),(12,'Регулярные выражения. Часть 2','Регулярные выражения. Часть 2','Регулярные выражения. Часть 2','',2,'\np(#toc).  \n\nh2. Группы\n\nКогда простого набора строк в качестве результата не достаточно, на помощь приходит возможность регулярных выражений возвращать результат разбитый на подгруппы. Чтобы разбить шаблон на группы используется обыкновенный скобки *(*, *)*.\n\nСледующее выражение можно использовать для поиска простых адресов e-mail.\n\n<div class=\"regex\"><dt>\\w+@\\w+.\\w+</dt><dd>Очевидно, следующие строки будут удовлетворять регулярному выражения:<br>Мой почтовый адрес **bird@yandex.ru**</dd></div>\n\nТеперь добавим скобки вокруг каждого *\\w+*. \n<div class=\"regex\"><dt>(\\w+)@(\\w+).(\\w+)</dt><dd>Таже строка:<br>Мой почтовый адрес **bird@yandex.ru**</dd></div>\n\nВроде бы ничего и не изменилось, однако теперь мы можем работать с подгруппами. В @Visual C#@ для этого у каждого объекта типа @Match@ есть свойство @Groups@, которое представляет массив подгрупп в выражении. Т.е например:\n\npre(brush:csharp).. \n/*\n Создадим регулярное выражения\n для поиска простых адресов e-mail:\n (\\w+)@(\\w+).(\\w+)\n\n \'@\' перед двойной кавычкой используется \n для экранирования обратного слеша \\,\n \n без символа @ пришлось бы писать:\n (\\\\w+)@(\\\\w+).(\\\\w+)\n*/\nRegex regEx = new Regex (@\"(\\w+)@(\\w+).(\\w+)\");\n\n/*\n Функция Match возвращает первый результат \n удовлетворяющий регулярному выражению\n*/\nMatch m = regEx.Match(\"Мой почтовый адрес bird@yandex.ru\");\n\nConsole.WriteLine( m.Groups[0] ); // выведет на экран bird@yandex.ru\"\nConsole.WriteLine( m.Groups[1] ); // выведет на экран bird\nConsole.WriteLine( m.Groups[2] ); // выведет на экран yandex\nConsole.WriteLine( m.Groups[3] ); // выведет на экран ru\n\np. Нумерация групп идет с @1@, нулевой группе соответствует все регулярное выражение.\n\nГруппы могут быть вложенными, например:\n<div class=\"regex\"><dt>(\\w+)@((\\w+).(\\w+))</dt><dd>Мой почтовый адрес **bird@yandex.ru**<br></dd></div>\n\nРезультат все тот же, но группы теперь будут иметь следующие значения\n\n# bird\n# yandex.ru\n# yandex\n# ru\n\nВидно, что @вторая@ группа содержит результат @третьей@ и @четвертой@ вместе, плюс еще точку между ними. Нумерация групп идет в соответствии с порядком открывающих скобок.\n\nВообще говоря, обращаться к группам мы можем и внутри регулярного выражения, для этого используются обратные ссылки. Обратная ссылка имеет вид обратного слеша с следующим за ним номером группы: @\\1, \\2, \\3 .. \\9@.\n\nЗачем кому-то могут понадобиться обратные ссылки? Ну например если ему надо будет искать строки с повторяющимися элементами. Например:\n\n<div class=\"regex\"><dt>(\\w+)\\1</dt><dd>Мой сосед <b>тото</b>о, не, не, <b>охох</b>о!<br></dd></div>\n\n@\\1@ - означает что мы хотим, чтобы стоящее в скобках повторилось еще один раз. Таки образом интерпретатор регэкспов находит строку @\'то\'@, видит что за ней снова идет точно такая строчка @\'то\'@, и отмечает результат как удовлетворяющий регулярному выражению. Продолжает поиск, пока не дойдет до @\'хо\'@. Строка @не, не,@ не удовлетворяет регулярному выражению так как в этой строке присутствуют запятые и пробелы, которые не входят в класс @\\w@.\n\nТакже группировку приходится использовать если необходимо найти в тексте строки с повторяющимися составными подстроками. Например чтобы найти в тексте простые предложения без знаков препинания можно использовать следующее выражение:\n\n<div class=\"regex\"><dt>(\\w+\\s*)+</dt><dd>**Мой сосед Тоторо**. <i>А я люблю желуди</i>.</dd></div>\n\nВ результате получим две подстроки соответствующие первому и второму предложения. И хотя хотелось бы, чтобы в качестве групп у нас были слова предложения. На деле же у нас будет всего одна группа содержащая последнее найденной в предложении слово. Т.е.:\n\n# Мой сосед Тоторо\n## Тоторо\n# А я люблю желуди\n## желуди\n\nСкорее всего толку от этого последнего слова вам не будет, синтаксис регулярных выражений позволяет нам отключить группу. Т.е. она будет использоваться для поиска, но в результат как подгруппа не попадет. Делается это путем добавления @?:@ после открывающей скобки:\n\n<div class=\"regex\"><dt>(?:\\w+\\s*)+</dt><dd><b>Мой сосед Тоторо</b>. <i>А я люблю желуди</i>.</dd></div>\n\nВ результате получим те же два предложения но уже без подгрупп.\n\n# Мой сосед Тоторо\n## --\n# А я люблю желуди\n## --\n\n<hr>\n\nh2. Просмотр вперед и назад\n\nИногда необходимо построить регулярное выражение, которое учитывает подстроки находящиеся до либо после результата, но в сам результат не попадающие. Для этого используются следующие конструкции:\n\n* @(?=шаблон)@ -- позитивный просмотр вперед\n* @(?!шаблон)@ -- негативный просмотр вперед\n* @(?<=шаблон)@ -- позитивный просмотр назад\n* @(?<!шаблон)@ -- негативный просмотр назад (ужас какой :O)\n\nНе знаю что сказать по этому поводу, так что вот лучше оставлю примеры здесь.\n\nСлово *два* справа от которого находится слово *три*\n\n<div class=\"regex\"><dt>два(?=\\s+три)</dt><dd>один <b>два</b> три два один</i>.</dd></div>\n\nОбратите внимание что слово *три* не попадает в результат поиска но тем не менее влияет на исходный результат.\n\nСлово *два* справа от которого нет слова *три*\n\n<div class=\"regex\"><dt>два(?!\\s+три)</dt><dd>один два три <b>два</b> один</i>.</dd></div>\n\nСлово *два* слева от которого находится слово *три*\n\n<div class=\"regex\"><dt>(@?<@=три\\s+)два</dt><dd>один два три <b>два</b> один</i>.</dd></div>\n\nСлово *два* слева от которого нет слова *три*\n\n<div class=\"regex\"><dt>(@?<@!три\\s+)два</dt><dd>один <b>два</b> три два один</i>.</dd></div>\n\n<hr>\n\nh2. Забыл упомянуть\n\nОперация инвертирования *^*, если вы вдруг захотите найти слово не начинающееся с какой-нибудь буквы, например буквы *а*:\n\n<div class=\"regex\"><dt>\\b[^a]\\w+</dt><dd>апельсин, <b>яблоко</b>, <b>банан</b>, ананас</dd></div>\n\nНе начинающееся с нескольких букв буквы, например букв *а,б*:\n\n<div class=\"regex\"><dt>\\b[^aб]\\w+</dt><dd>апельсин, <b>яблоко</b>, банан, ананас</dd></div>\n\nТут обязательно надо использовать символ границы слова *\\b* так как операция отрицания захватывает все символы в том числе и те, что не попадают в разряд букв.\n\nЗабыл упомянуть пару специальных символов:\n\n* ^ -- начало строки\n* $ -- конец строки\n\nСобственно и все.\n\nПотренироваться в написании можно тут \"rextester.com\":http://rextester.com/tester. В левом поле пишем регулярку, в правом текст для анализа, жмем F8.\n\nЕсли вы захотите узнать о регулярных выражения побольше, то начать можно с \n\"википедии\":http://ru.wikipedia.org/wiki/Регулярные_выражения, там вам расскажут что регулярные выражения бывают нескольких видов POSIX и PCRE, наши второго типа. Еще регулярные выражения бывают ревнивые и допускают использование условий.\n\nНу а если вы почувствуете себя гуру регулярных выражений, то вам сюда: \"Regex Tuesday - Challenges\":http://callumacrae.github.io/regex-tuesday/.',1,6,0,158,0,1391936831),(13,'Литература','Литература','Книги по Мат.Логике','',4,'*{list-style:none;padding-left:0} \n* \"Мальцев А.И. Алгебраические системы\":files/Мальцев_Алгебраические_системы.djvu -- про отношения\n* \"Мальцев А.И. Алгоритмы и рекурсивные функции\":files/А.И.Мальцев_-_Алгоритмы_и_рекурсивные_функции.djvu -- про Машины Тьюринга\n* \"Мендельсон Э. Введение в математическую логику\":files/Мендельсон_Э._Введение_в_математическую_логику.djvu -- формальная логика, предикаты, вывод и т.д\n* \"Лорьер Системы искуственного интеллекта\":files/Лорьер_-_Системы_искуственного_интеллекта.djvu -- сложность, NP-полнота и еще много чего\n',1,0,0,219,0,1392116181),(19,'Шаблоны вывода','Шаблоны вывода','Шаблоны вывода','',2,'Что ж такое шаблон? Шаблон -- это некое  подобие формы (анкеты) которую будет заполнять ваша программа. \n\nЗачем использовать шаблон если можно вывести ответ в файл либо, на худой конец, на экран консоли? А затем чтобы придать вашей программе \"гибкости\". \n\nФорма вывода хранится в отдельном файле и практически ни как не связана с кодом программы. Больше не нужно ковыряться в коде @C#@, перекомпилировать программу(нажимая *F5*); теперь, чтобы изменить форму вывода, вам вообще не нужна *Visual Studio*, вы открываете ваш любимый текстовый редактор, правите текста файла шаблона, и запускаете свою программу.\n\n<div class=\"note\">Еще раз напомню для тех кто все еще не в курсе, нажимая *F5* в *VisualStudio*, в папке:\n@c:\\Users\\Имя_Пользователя\\Documents\\Visual Studio 2010\\Projects\\Имя_Проекта\\Имя_Проекта\\bin\\Debug@ \nсоздается файл @Имя_Проекта.exe@, который и является программой, и который можно рассылать друзьям и подругам, причем, ни тем ни другим для запуска этого файла устанавливать *Visual Studio* совсем необязательно.</div>\n\nТак как функционала *C#.Net* местами ограничен, придется использовать стороннюю библиотечку. Библиотечка называется \"StringTemplate\":http://www.stringtemplate.org/. Функционал которой включает в себя и возможность генерировать отчеты на основе шаблона и данных вашей программы.\n\nЭто абсолютно нормальная практика использовать сторонние программы (т.н. third party software). \n\nЕсли вам лень шастать по сайту в поисках нужного файла просто нажмите \"сюда\":http://www.tunnelvisionlabs.com/downloads/antlr/antlr-dotnet-st4-4.0.7.1.7z.\n\nРаспаковываем архив. В принципе не особо важно куда. У меня под все сторонние библиотеки есть отдельная папка, куда я их все и скидываю. \n\nДолжно получиться что-то в этом роде:\n!images/image_template_dir.png!\n\nТеперь чтобы можно было использовать функции этой библиотечки, ее надо подключить к проекту. Для этого в главном меню проекта в VisualStudio выбираем: @Project / Add Reference@ ( @Проект/ Добавить ссылку@)\n!images/image_template_dir2.png!\n\nВыбираем четверутю вкладку, в ней надо указать путь к файлу. \nНас интересует файл @Antlr4.StringTemplate.dll@\n!images/image_template_dir3.png!\n\nКликаем нужный файл и при необходимости жмем @Ok@. Все теперь осталось подключить пространство имен:\n\npre(brush:csharp).. \nusing System;\nusing System.Collections.Generic;\nusing System.Linq;\nusing System.Text;\n\nusing Antlr4.StringTemplate; // чтобы работать с шаблонами\n...\n\np. Рассмотрим простой @html@-шаблон который сохраним в файл @шаблон.html@. \n\npre(brush:html).. \n<html>\n<head> \n<title> $title$ </title>\n</head>\n<body>\n<h1> $greeting$ </h1>\n</body>\n</html>\n\np. Строки заключенные между знаками @$@ есть переменные. В нашем шаблоне две переменные @title@ и @greeting@. Заполняя шаблон переменные буду заменяться на те значения, которые будут переданы генератору шаблонов в программе.\n\nНапишем простую программу которая заполняет этот шаблон, и создает новый html-документ, но уже с заполненными полями:\n\npre(brush:csharp).. \n// Сначала мы считываем текст из файла с шаблоном\nString templateText = File.ReadAllText(@\"шаблон.html\");\n\n/* \n Создадим генератор шаблонов\n В качестве параметра передается текст шаблона, \n и два специальных параметра\n соответствующих символам по которым \n генератор определяет где конец и начало переменной в шаблоне.\n*/\nTemplate templateGenerator = new Template(templateText, \'$\', \'$\');\n\n/*\n установим значение переменной @title@\n первый параметр -- имя переменной\n второй параметр -- значение переменной\n*/\ntemplateGenerator.Add(\"title\", \"Приветствие\");\n\n// установим значение переменной @greeting@\ntemplateGenerator.Add(\"greeting\", \"Всем привет! ^_^\");\n\n/*\n Генерируем текст заполненного шаблона\n и сохраняем его в новую переменную.\n*/\nString textOut = templateGenerator.Render();\n\n// Сохраняем сгенерированный текст, как новый html-документ\nFile.WriteAllText(@\"out.html\", textOut);\n\n\np. В результате работы программы документ *out.html* будет содержать следующий текст:\n\npre(brush:html).. \n<html>\n<head> \n<title> Приветствие </title>\n</head>\n<body>\n<h1> Всем привет! ^_^ </h1>\n</body>\n</html>\n\np. Вроде бы ничего хитрого.\n\nРассмотри более сложный пример. Пусть у нас теперь будет список объектов. Приведу для начала код программы:\n\npre(brush:csharp).. \nusing System;\nusing System.Collections.Generic;\nusing System.Linq;\nusing System.Text;\n\nusing System.IO; // для работы с файлами\n\nusing Antlr4.StringTemplate; // для работы с шаблонами\n\nnamespace ConsoleApplication1\n{\n    /* создал свою структуру для хранения информации о цвете */\n    struct ColorInfo\n    {\n        // идентификатор, притворяюсь строчкой из БД\n        public int id; \n        // имя цвета (красный, синий, оранжевый и т.д.)\n        public String name; \n        // шестнадцатеричное значение (0xFF0000, 0x0000FF, 0xFFFF00 и т.д.)\n        public String hexCode; \n    }\n\n    class Program\n    {\n        static void Main(string[] args)\n        {\n            // создаю список цветов\n            List<ColorInfo> colors = new List<ColorInfo>(); \n\n            // читаю текст шаблона\n            String templateText = File.ReadAllText(@\"шаблон.html\");\n\n            /*\n             * Закину значений в список colors,\n             * тут я использую хитрый способ закидывания переменных\n             * с одновременной инициализацией их значений\n             */\n            colors.Add(new ColorInfo { id = 7, hexCode = \"#FF0000\", name = \"Red\" });\n            colors.Add(new ColorInfo { id = 12, hexCode = \"#00FF00\", name = \"Green\" });\n            colors.Add(new ColorInfo { id = 16, hexCode = \"#0000FF\", name = \"Blue\" });\n\n            // создаю генератор шаблонов\n            Template tg = new Template(templateText, \'$\', \'$\');\n\n            // передаю список цветов как переменную colors\n            tg.Add(\"colors\", colors);\n            // указываю заголов файла\n            tg.Add(\"title\", \"Список цветов\");\n\n            // одновременно генерирую и сразу сохраняю сгенерированный текст в файл\n            File.WriteAllText( @\"out.html\", tg.Render() );\n        }\n    }\n}\n\np. Теперь рассмотрим код шаблона @шаблон.html@:\n\npre(brush:html).. \n<!DOCTYPE html>\n<html>\n<head>\n<title> $title$ </title>\n</head>\n<body>\n    <h1>$title$</h1>\n    У нас $colors.Count$ цвета.\n    <ul>\n      $colors:{ clr | <li>$clr.name$</li> }$\n    </ul>\n</body>\n</html>\n\np. С переменной @title@ все как и в прошлый раз, передали значение -- получили текст. Тут используем дважды, в принципе ни кто не мешает использовать сколько угодно раз.\n\n@$colors.Count$@ -- Обращаемся к свойству @Count@ списка colors. Заменится на цифру 3.\n\nТеперь рассмотрим обработку списка\n\npre(brush:html).. \n...\n<ul>\n  $colors:{ clr | <li>$clr.name$</li> }$\n</ul>\n...\n\np. Здесь создается ненумерованный список. Переменная @colors@ содержит список в качестве значения. Генератор шаблонов позволяет обрабатывать списки, то есть проходить по всех их элементам.\n\nПр принципу напоминает работу оператора @foreach@ из @C#@. \n\n* @$@ -- начало обработки переменной @colors@\n* @colors:{ clr |@ -- для каждого элемента списка @colors@ генерируем текст указанный после черты, @clr@ -- используем в качестве псевдонима для обращения к элементам списка \n* @<li>$clr.name$</li>@ -- создаем html-элемент списка, в качестве текста которого используется, свойство @name@ элемента @clr@ (напомню: @clr@ -- это элемент типа @ColorInfo@)\n* @}$@ -- прекращаем обработку переменной @colors@\n\nВ результате файл *out.html* будет содержать следующий текст\n\npre(brush:html).. \n<html>\n<head>\n<title> Список цветов </title>\n</head>\n<body>\n    <h1>Список цветов</h1>\n  У нас 3 цвета.\n  <ul>\n      <li> Red </li> <li> Green </li> <li> Blue </li> \n    </ul>\n</body>\n</html>\n\np. Если хочется чтобы каждый элемент списка выводился с новой строки, добавьте @$\\n$@ после @</li>@ в коде шаблона. Должно получиться: \n\npre(brush:html).. \n...\n<ul>\n  $colors:{ clr |<li>$clr.title$</li>$\\n$ }$\n</ul>\n...\n\np. В принципе этого вполне хватит для создания шаблонов практически любой сложности. @StringTemplate@ кстати поддерживает проверку условий и еще много чего, так что дерзайте и читайте документацию. Начать можно \"отсюда\":http://www.antlr.org/wiki/display/ST/Five+minute+Introduction.\n\n<hr><h2>ЗЫ</h2>\nНу и на закуску еще три шаблона:\n\nТут я вместо списка использую таблицу:\n\npre(brush:html).. \n<head>\n<title> $title$ </title>\n</head>\n<body>\n  <h1>$title$</h1>\n  <table border=\"1\">\n    <tr>\n      <th>id</th>\n      <th>название</th>\n      <th>код</th>\n    </tr>\n    $colors: { clr |\n    <tr>\n      <td>$clr.id$</td>\n      <td>$clr.name$</td>\n      <td>$clr.hexCode$</td>\n    </tr>  \n    }$\n  </table>\n</body>\n</html>\n\np. А тут я использую возможности @CSS@, чтобы разукрасить текст в списке\n\npre(brush:html).. \n<!DOCTYPE html>\n<html>\n<head>\n<title> $title$ </title>\n</head>\n<body>\n    <h1>$title$</h1>\n    <ul>\n      $colors:{ clr |\n        <li style=\"color:$clr.hexCode$\">\n          $clr.name$ -- цвет под номеров $clr.id$\n        </li> \n      }$\n    </ul>\n</body>\n</html>\n\np. Ну и табличка разукрашенная:\n\npre(brush:html).. \n<!DOCTYPE html>\n<html>\n<head>\n<title> $title$ </title>\n  <style>\n    td,th { padding: 10px; }\n    th {background: #EEE; color: black;}\n    table {border-collapse:collapse}\n  </style>\n</head>\n<body>\n  <h1>$title$</h1>\n  <table border=\"1\">\n    <tr>\n      <th>id</th>\n      <th>название</th>\n      <th colspan=\"2\">цвет</th>\n    </tr>\n    $colors: { clr |\n    <tr>\n      <td>$clr.id$</td>\n      <td>$clr.name$</td>\n      <td>$clr.hexCode$</td>\n      <td style=\"background:$clr.hexCode$\"></td>\n    </tr>  \n    }$\n  </table>\n</body>\n</html>\n\np. \n',1,9,0,149,1384085886,1386947732),(17,'Основы HTML','Основы HTML','Основы HTML','',2,'\n*HTML* есть, буквально, язык разметки гипертекстов (Hypertext Markup Language). Не является языком программирования и используется для форматирования текста и прочего содержимого html-страниц. Форматирование осуществляется за счет использования тегов. Всякий тег имеет вид @<some_tag_name>@. \n\nТеги бывают открывающие: @<body>@ и закрывающие: @</body>@. Как видно закрывающий тег отличается от открывающего наличием прямого слеша.\n\nПример простой HTML-страницы:\n\npre(brush:html).. \n<!DOCTYPE html>\n<html> \n<head> \n  <title>Страничка</title>\n</head> \n<body> \n  <h1>Моя страничка</h1>\n  <p>Привет!\n  Ура!\n  <br>Добра всем!!!\n  <p>Все работает!!! :D\n</body> \n</html> \n\np. На самом деле html-страница есть не что иное как обыкновенный текстовый документ. Как правило html-документы открываются браузером (chrome, firefox, opera и т.д.). Браузер же в свою очередь в соответствии с тем что в документе написано выдает нам то что мы привыкли называть веб-страницей. \n\nРазберем что же у нас написано на страничке:\n# @<!DOCTYPE html>@ -- первый тег, требование стандарта оформления html-страниц, сообщает о том, что все что находится ниже является элементами *HTML*. В принципе можно не писать.\n# @<html>@ и @</html>@ -- все что находится между @<html>@ и @</html>@ есть содержимое html-страницы.\n# @<head>@ и @</head>@ -- (head: голова). Служебная, непечатная информация об странице. Между двумя этими тегами как правило помещают другие подтеги: заголовок страницы, ключевые слова, ссылки на сторонние ресурсы, скрипты, стили и прочую информацию влияющую на поведение и отображение содержимого html-страницы. У нас внутри @<head>@ только название страницы\n# @<title>@ и @</title>@ -- (title: название). Между двумя тегами располагают название страницы, как он отображается во вкладке браузера.\n# @<body>@ и @</body>@ -- (body: тело). Собственно все содержимое страницы располагается между этими двумя тегами.\n# @<h1>@ и @</h1>@ -- текст расположенные между этими двумя и тегами будет отображен как заголовок 1-уровня, т.е. большими жирным буквами.\n# @<p>@ -- (paragrah: абзац). Используется для того, чтобы начать новый абзац.\n# @<br>@ -- (brake: тормозить). Используется для того, чтобы начать новую строку.\n\nПопробуйте создать пустой текстовый файл. Смените его расширение c *txt* на *html*, скопируйте в него текст из примера, и запустите файл. По идее он должен открыться в вашем браузере по умолчанию, и вы должны увидеть что-то вроде этого: !(img-small)images/image_html_sample.png! Обратите внимание что несмотря на то, что в примере *Ура!* перенесено на новую строку, браузер это проигнорировал. Это так и должно быть. Наличие переходов на новую строку, а также попытка поставить более 1 пробела, будет проигнорирована интерпретатором html-разметки (то бишь браузером). В данной ситуации было бы правильнее написать:\n\npre(brush:html).. \n  ...\n  <p>Привет!\n  <br>Ура!\n  <br>Добра всем!!!\n  ...\n\np. либо так\n\npre(brush:html).. \n  ...\n  <p>Привет!<br>\n  Ура!\n  <br>Добра всем!!!\n  ...\n\np. В принципе можно явно указывать границы строк и абзацов:\n\npre(brush:html).. \n  ...\n  <p>\n  <br>Привет!</br>\n  <br>Ура!</br>\n  <br>Добра всем!!!</br>\n  </p>\n  ...\n\np.  но как правило в этом нет необходимости.\n<hr>\n\nh2. Ссылки\n\nГипертексты не были бы гипертекстами, если бы не возможность создавать гиперссылки. Гиперссылки позволяют перемещаться между html-документами.\n\nСоздать гиперссылку легко, для этого используется тег @<a>@. Однако одного тега не достаточно, необходимо дополнительно использовать атрибут @href@, которому присваивается адрес ссылки.\n\nДобавить атрибут к тегу очень легко. Общий синтаксис тега с атрибутом имеет следующий вид:\n\npre(brush:html).. \n<tag att1=\"value1\" att2=\"value2\" ... >\n\np. tag -- это имя тега; att1, att2 -- имена атрибутов; value1, value2 -- значения соотвествующих атрибутов.\n\nТаким образом чтобы создать ссылку например на википедию, надо добавить в тело html-страницы (тег @<body>@), следующий код:\n\npre(brush:html).. \n<a href=\"http://ru.wikipedia.org\">кликни меня</a>\n\np. Текст содержащийся между открывающим и закрывающим тегом, и увидит пользователь. Можно продолжить предыдущий пример:\n\npre(brush:html).. \n  ...\n  <p>Все работает!!! :D\n  <br>\n  <a href=\"http://ru.wikipedia.org\">кликни меня</a>\n  ...\n\np. Получится что-то в этом роде: !(img-small)images/image_html_sample2.png!\n\nМожно соединить сколько угодно файлов с помощью ссылок. Создадим в одной папке два файла:\n<table width=100%><tr><th>first.html</th><th>second.html</th></tr><tr><td>\n\npre(brush:html).. \n<!DOCTYPE html>\n<html> \n<head> \n  <title>Первая</title>\n</head> \n<body> \n  <h1>Первая страничка</h1>\n  <a href=\"second.html\">\n   перейти на вторую страничку\n  </a>\n</body> \n</html>\n\np. </td><td>\n\npre(brush:html).. \n<!DOCTYPE html>\n<html> \n<head> \n  <title>Вторая</title>\n</head> \n<body> \n  <h1>Вторая страничка</h1>\n  <a href=\"first.html\">\n    назад на первую страничку\n  </a>\n</body> \n</html>\n\np. </td></tr></table> \nОткрыв один файл в браузере, мы сможем попадать на другой нажимая на ссылку.\n<hr>\n\nh2. Изображения\n\nЧтобы вставить изображение используется тег @<img>@. Главный атрибут у тега @src@, используется для указания пути к файлу изображения. В качестве файла можно использовать как локальный файл, указывая абсолютный адрес файла:\n\npre(brush:html).. \n<img src=\"D:/Изображения/happines.jpeg\" >\n\np. относительный путь:\n\npre(brush:html).. \n<img src=\"images/happines.jpeg\" >\n\np. В так случае, как правило, подразумевается что директория *images* находится в той же папке где и файл, в который вставлено изображения. \nНу и естественно можно использовать ссылку на файл в интернете:\n\npre(brush:html).. \n<img src=\"http://24.media.tumblr.com/21e90b1e647f020b1816be93ce7b1760/tumblr_mi1bc2h5Bs1rq8f6wo1_500.gif\" >\n\np. Для тега @<img>@ не существует закрывающего тега. Ну то есть написать его конечно можно, но браузер его просто проигнорирует.\n<hr>\n\nh2. Списки\n\nСписки бывают двух типов: нумерованные и простые. \n\nДля простого списка используется тег @<ul>@, каждый элемент списка заключается в пару тегов @<li>@ и @</li>@\n<table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr><td width=50%>\n\npre(brush:html).. \n<ul>\n  <li>Первый элемент</li>\n  <li>Второй элемент</li>\n  <li>Третий элемент</li>\n</ul>\n\np. </td><td style=\"background:white;\"><ul>  <li>Первый элемент</li>  <li>Второй элемент</li>  <li>Третий элемент</li></ul></td></tr></table>\n\nДля нумерованного списка используется тег @<ol>@: <table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr><td width=50%>\n\npre(brush:html).. \n<ol>\n  <li>Первый элемент</li>\n  <li>Второй элемент</li>\n  <li>Третий элемент</li>\n</ol>\n\np. </td><td style=\"background:white;\"><ol>  <li>Первый элемент</li>  <li>Второй элемент</li>  <li>Третий элемент</li></ol></td></tr></table>\n<hr>\n\nh2. Таблицы\n\nТаблицы состоят из строка, каждая строка может содержать несколько ячеек. При необходимости ячейки и строки можно объединять. Таблица задается парой тегов @<table>@ и @</table>@.\n\nПример таблицы: <table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr><td width=50%>\n\npre(brush:html).. \n<table>\n <tr>\n  <td>Элемент 1.1</td> \n  <td>Элемент 1.2</td> \n  <td>Элемент 1.3</td>\n </tr>\n\n <tr>\n  <td>Элемент 2.1</td>\n  <td>Элемент 2.2</td> \n  <td>Элемент 2.3</td>\n </tr>\n\n <tr>\n  <td>Элемент 3.1</td>\n  <td>Элемент 3.2</td> \n  <td>Элемент 3.3</td>\n </tr>\n</table>\n\np. </td><td align=center style=\"background:white;\"><table><tr> <td>Элемент 1.1</td> <td>Элемент 1.2</td> <td>Элемент 1.3</td> </tr><tr><td>Элемент 2.1</td> <td>Элемент 2.2</td> <td>Элемент 2.3</td> </tr></tr><tr><td>Элемент 3.1</td> <td>Элемент 3.2</td> <td>Элемент 3.3</td> </tr></table></td></tr></table>\n\nТэги @<tr>@, @</tr>@ обозначает начало и конец строки. Тэги @<td>@, @</td>@ используется для обозначения ячейки в строке, и обязательно должны находится между тегами @<tr>@, @</tr>@. \n\nЗа объединение строк отвечает атрибут @rowspan@. В качестве значения атрибута указывается сколько строк должна занимать ячейка. Атрибут добавляется к тегу @<td>@. <table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr><td width=50%>\n\npre(brush:html).. \n<table>\n <tr>\n  <td>Элемент 1.1</td> \n  <td rowspan=2>Элемент 1.2</td> \n  <td>Элемент 1.3</td>\n </tr>\n\n <tr>\n  <td>Элемент 2.1</td>\n  \n  <td>Элемент 2.3</td>\n </tr>\n</table>\n\np. <td align=center style=\"background:white;\"><table><tr><td>Элемент 1.1</td> <td rowspan=2 >Элемент 1.2</td> <td>Элемент 1.3</td></tr><tr><td>Элемент 2.1</td><td>Элемент 2.3</td></tr></table> </td> </tr></table>\n\nЗа объединение столбцов отвечает атрибут @colspan@. В качестве значения атрибута указывается сколько столбцов должна занимать ячейка. Атрибут также добавляется к тегу @<td>@. <table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr><td width=50%>\n\npre(brush:html).. \n<table>\n <tr>\n  <td colspan=2>Элемент 1.1</td> \n  \n  <td>Элемент 1.3</td>\n </tr>\n\n <tr>\n  <td>Элемент 2.1</td>\n  <td>Элемент 2.2</td> \n  <td>Элемент 2.3</td>\n </tr>\n</table>\n\np. <td align=center style=\"background:white;\"><table><tr><td colspan=2>Элемент 1.1</td> <td>Элемент 1.3</td></tr><tr><td>Элемент 2.1</td><td>Элемент 2.2</td><td>Элемент 2.3</td></tr></table> </td> </tr></table>\n\nЕстественно никто не мешает использовать оба атрибута одновременно.<table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr><td width=50%>\n\npre(brush:html).. \n<table>\n <tr>\n  <td colspan=2 rowspan=2>Элемент 1.1</td> \n  \n  <td>Элемент 1.3</td>\n </tr>\n <tr>\n \n\n  <td>Элемент 2.3</td>\n </tr>\n <tr>\n  <td>Элемент 3.1</td>\n  <td>Элемент 3.2</td> \n  <td>Элемент 3.3</td>\n </tr> \n</table>\n\np. <td align=center style=\"background:white;\"><table><tr><td colspan=2 rowspan=2>Элемент 1.1</td> <td>Элемент 1.3</td></tr><tr><td>Элемент 2.3</td></tr><tr><td>Элемент 3.1</td><td>Элемент 3.2</td><td>Элемент 3.3</td></tr></table> </td> </tr></table>\n\n<hr>\n\nh2. Декорации\n\n<table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr> <td width=50%>\n\npre(brush:html).. \n<b>Жирный текст</b>\n\n<i>Курсив</i>\n\n<u>Подчеркнутый</u>\n\n<s>Перечеркнутый</s>\n\n<q>В кавычках</q>\n\np. </td><td align=center style=\"background:white;\"><b>Жирный текст</b><br>\n<i>Курсив</i><br>\n<u>Подчеркнутый</u><br>\n<s>Перечеркнутый</s><br>\n<q>В кавычках</q><br>\n</td></tr></table>\n\nАбзацы можно выравнивать <table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr> <td width=50%>\n\npre(brush:html).. \n<p align=left>Выравненный влево\n\n<p align=center>Выравненный по центру\n\n<p align=right>Выравненный вправо\n\np. <td><p align=left style=\"background:white;\">Выравненный влево<p align=center>Выравненный по центру<p align=right>Выравненный вправо</td></tr></table>\n\nЗаголовки:<table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr> <td width=50%>\n\npre(brush:html).. \n<h1>Заголовок1</h1>\n\n<h2>Заголовок2</h2>\n\n<h3>Заголовок3</h3>\n\n<h4>Заголовок4</h4>\n\n<h5>Заголовок5</h5>\n\n<h6>Заголовок6</h6>\n\np. </td><td align=center style=\"background:white;\"><h1>Заголовок1</h1><h2>Заголовок2</h2><h3>Заголовок3</h3><h4>Заголовок4</h4><h5>Заголовок5</h5><h6>Заголовок6</h6></td></tr></table>\n\nВерхний и нижний индексы:<table width=100%><tr><th>Код</th><th>Отображение</th></tr><tr> <td width=50%>\n\npre(brush:html).. \nиндекс<sup>верхний</sup> | индекс<sub>нижний</sub>\n\np. </td><td align=center style=\"background:white;\">индекс<sup>верхний</sup> | индекс<sub>нижний</sub></td></tr></table>\n\n<hr>\n\nh2. PS\n\nВообще говоря про html-страницы можно еще ОЧЕНЬ много чего рассказать. Но так как цель данного урока ознакомить вас с основами языка форматирования текста, я больше ничего и не скажу :3',1,7,0,97,1382458008,1391936924),(18,'Структуры. Форматированный текст.','Структуры. Форматированный текст.','Структуры. Форматированный текст.','',2,'\np(#toc).  \n\nh2. Структуры (struct)\n\nОдним из наиболее эффективных способов повысить наглядность кода -- начать использовать структуры. Классический пример: вам надо хранить информацию о жителях города. Эта информацию включает в себя, допустим, имя, фамилию, возраст, адрес. Главное требование, это возможность по номеру жителя быстро узнать информацию о нем. Решение в лоб предлагает нам следующие альтернативы:\n\nПервый способ, хранить список строк, разделяя каждый элемент каким-нибудь разделителем (например *;*):\n\npre(brush:csharp).. \nList<string> infoList = new List<string>;\n\ninfoList.add(\"Вася; Пупкин; 21; Иркутск, ул. Байкальская 1-2\");\ninfoList.add(\"Маша; Анюткина; 21; Иркутск, ул. Ангарская 3-4\");\n\np. Если нам захочется получить доступ к фамилии 1 человека в списки, нам придется разбить строку функцией @Split@, и обратиться ко 2 элементу списка подстрок:\n\npre(brush:csharp).. \nstring[] human = infoList[0].Split(\";\");\nConsole.WriteLine(human[1]); // выведет на экран: Пупкин\n\np. Слишком много кода для, казалось бы, такой тривиальной операции, как обращение к подэлементу элемента списка.\n\nВторой способ, создать четыре списка, и в каждом списке хранить соответствующий элемент записи:\n\npre(brush:csharp).. \nList<string> names = new List<string>(); // список под имена\nList<string> families = new List<string>(); // список под фамилии\nList<int> ages = new List<string>(); // список под возраст\nList<string> adresses = new List<string>(); // список под адреса\n\n/*\n добавляем новую запись\n тут главное синхронизировать \n операцию добавления данных\n*/\nnames.Add(\"Вася\");\nfamilies.Add(\"Пупкин\");\nages.Add(\"21\");\nadresses.Add(\"Иркутск, ул. Байкальская 1-2\");\n\n// теперь чтобы узнать фамилию первого жителя достаточно написать так:\nConsole.WriteLine(families[0]);\n\np. В принципе неплохо, однако использование 4 отдельных списков сильно портит впечатление.\n\nЧтобы избавиться от такого набора списков, *C#* дает нам возможность создавать свои типы данных. Создадим структуру, которая объединит информацию о в один элемент жителе:\n\npre(brush:csharp).. \n\nstruct Settler \n{\n  public string Name;\n  public string Family;\n  public int Age;\n  public string Address;\n}\n\np. Мы создали свой тип данных. Теперь мы можем использовать его, точно так же как мы до этого использовали типы @int@, @string@, @List@, @Dictionary@ и т. д.\n\nОбъявлять свои типы можно в принципе где угодно, лишь бы не в теле функции:\n\npre(brush:csharp).. \nusing System;\nusing System.Collections.Generic;\nusing System.Linq;\nusing System.Text;\n\nnamespace ConsoleApplication1 \n{\n\n  // например тут\n  struct Settler \n  {\n    public string Name;\n    public string Family;\n    public int Age;\n    public string Address;\n  }\n  // до начала функции Main\n\n  static void Main(string[] args)\n  {\n    // тут нельзя\n    ...\n  }\n}\n\np. Теперь можно создать переменную типа Settler, и заполнить ее данными:\n\npre(brush:csharp).. \n// инициализируем переменную vasya\nSettler vasya = new Settler();\n\n// заполняем данные\nvasya.Name = \"Вася\";\nvasya.Family = \"Пупкин\";\nvasya.Age = 21;\nvasya.Address = \"Иркутск, ул. Байкальская 1-2\";\n\n// выведем на экран фамилию\nConsole.WriteLine(vasya.Family);\n\np. Кстати заполнить переменную можно сразу одновременно с инициализацией:\n\npre(brush:csharp).. \n\n// инициализируем и сразу заполняем\nSettler vasya = new Settler{\n  Name = \"Вася\",\n  Family = \"Пупкин\",\n  Age = 21,\n  Address = \"Иркутск, ул. Байкальская 1-2\",\n};\n\n// выведем на экран фамилию\nConsole.WriteLine(vasya.Family);\n\np. Теперь, если нам захочется хранить информацию о жителях города, достаточно будет создать один список:\n\npre(brush:csharp).. \n// создадим список\nList<Settler> settlers = new List<Settler>();\n\n// добавим пару записей в список\nsettlers.Add(new Settler {\n  Name = \"Вася\",\n  Family = \"Пупкин\",\n  Age = 21,\n  Address = \"Иркутск, ул. Байкальская 1-2\"\n});\n\nsettlers.Add(new Settler {\n  Name = \"Маша\",\n  Family = \"Анюткина\",\n  Age = 21,\n  Address = \"Иркутск, ул. Байкальская 3-4\"\n});\n\n// выведем на экран фамилию второго человека в списке\nConsole.WriteLine( settlers[1].Family );\n\np. Красота :D\n\n<hr>\n\nh2. Чтение форматированных данных\n\nЧасто данные для обработки вы будете получать в качестве некоторого строго отформатированого текста. Как правило это будет подобие таблички базы данных, где каждая строка текста будет соответствовать строке таблицы. Ну и одна колонка будет отделяться от другой каким-нибудь разделителем, например пробелом, точкой с запятой или знаком табуляции (@\\t@ в C#). Например:\n\npre(brush:csharp).. \n#name fullname english alpha2 alpha3 iso location location-precise\nАбхазия;Республика Абхазия;Abkhazia;AB;ABH;895;Азия;Закавказье\nАвстралия;;Australia;AU;AUS;036;Океания;Австралия и Новая Зеландия\nАвстрия;Австрийская Республика;Austria;AT;AUT;040;Европа;Западная Европа\nАзербайджан;Республика Азербайджан;Azerbaijan;AZ;AZE;031;Азия;Западная Азия\nАлбания;Республика Албания;Albania;AL;ALB;008;Европа;Южная Европа\nАлжир;Алжирская Народная Демократическая Республика;Algeria;DZ;DZA;012;Африка;Северная Африка\nАмериканское Самоа;;American Samoa;AS;ASM;016;Океания;Полинезия\nАнгилья;;Anguilla;AI;AIA;660;Америка;Карибский бассейн\nАнгола;Республика Ангола;Angola;AO;AGO;024;Африка;Центральная Африка\n\np. Тут у нас список стран. Первая строка содержит название столбцов, т.е. по сути поясняет нам какие столбики чему соответствуют, и по сути данными не является. И при считывании данных из файла ей можно пренебречь.\n\nСоздадим структуру которая будет соответствовать одной строчке данного файла:\n\npre(brush:csharp).. \nstruct Country \n{\n  public string Name;     // название страны\n  public string Fullname; // полное название страны\n  public string English;  // на английском\n  public string Alpha2;   // буквенный код 1\n  public string Alpha3;   // буквенный код 2\n  public string Iso;      // цифровой код\n  public string Location; // материк\n  public string LocationPrecise; // географическое местоположение\n}\n\np. Теперь считаем текст и сформируем список структур @Country@\n\npre(brush:csharp).. \n// читаем текст из файла\nstring fileText = File.ReadAllText(\"countries.txt\");\n\n// разбиваем текст на строки\nstring[] lines = fileText.Split(new string[] { \"\\n\" });\n\n// создаем список под страны\nList<Country> Countries = new List<Country>();\n\nforeach(var l in lines) \n{\n  /*\n   если первый символ в строке #, \n   то переходим  следующей строке\n  */\n  if (l[0] == \'#\') continue; \n\n  // разбиваем строку точками с запятыми\n  string[] words = l.Split(\";\");\n\n  //создаем новую переменную типа Country;\n  Country c = new Country();\n\n  // заполняем ее данными\n  c.Name = words[0];\n  c.Fullname = words[1];\n  c.English = words[2];\n  c.Alpha2 = words[3];\n  c.Alpha3 = words[4];\n  c.Iso = words[5];\n  c.Location = words[6];\n  c.LocationPrecise = words[7];\n\n  // добавляем в общий список данных\n  Countries.Add(c);\n\n}\n\np. После выполнения сей магической процедуры, нам будет очень удобно работать с данными:\n\npre(brush:csharp).. \n/*\n следующее заклинание выведет:\n Страна Албания находится в Европа\n*/\nConsole.WriteLine(\"Страна \" + Countries[4].Name + \" находится в \" + Countries[4].Location);\n\np. Ну не то чтобы совсем удобно, но вполне ничего.',1,8,0,142,1382950214,1391936937),(20,'МТ и задача покрытия','МТ и задача покрытия','МТ и задача покрытия','',4,'Целью задачи является поиск МТ решающих \"задачу о покрытии\":http://en.wikipedia.org/wiki/Set_cover_problem (в первой же секции очень хорошо расписано что, такое задача о покрытии, на русской вики ничего не понятно @>_>@) некоторой заданной размерности @n@ за @m@ шагов.\n\nЕсли такие МТ не будут найдены, то можно будет смело утверждать что не существует алгоритма решающего задачу о покрытии за заданный промежуток времени. Если же машины будут найдены, то можно будет поизучать их свойства, что, в свою очередь, может дать толчок в направлении решения проблемы NP, и в принципе рассматриваться как отдельная задача.\n\nЕстественно, @n@ и @m@ берутся достаточно большие. В качестве размерности задачи будем рассматривать размерность матрицы (задачу о покрытии удобно рассматривать на матрице из нулей и единиц). Обыкновенный ПК ограничит нас значением @n@ порядка 5-8. Значение @m@ подобрать сложнее, в принципе для начала можно ограничится 1000 шагами.\n\nОчевидно, что перебрать все МТ не возможно. Поэтому необходимо наложить ограничения на параметры машины. Ограничив ее алфавит числом N ~A~, количество состояний -- N ~S~.\n\nТак как целью перебора является поиск МТ решающих задачу о покрытии, соответственно каждую машину необходимо запустить на каждой индивидуальной задачи о покрытии и проверить:\n\n# Остановиться ли МТ раньше чем отщелкает @m@ тактов. В этом случае достаточно проверить является ли ответ верным. \n** Если МТ запустили на задачи не имеющей решение ответ должен быть отрицательным.\n** Соответственно для задачи имеющей решение ответ должен быть положительным.\n# Если число тактов превысит @m@, МТ можно смело отбросить, так как она работает слишком медленно (в смысле, для нас медленно, выбрали бы другое @m@ -- казалось бы быстрее).\n\nТеперь, возможно, станет понятно почему у нас ограничение на размерности задачи. Каждую МТ необходимо запустить на КАЖДОЙ индивидуальной задачи заданной размерности @n@. Матриц (квадратных) размерности @n@ из нулей и единиц 2 ^nXn^. Это очень большое число даже для @n=5@, вспоминаем историю создания шахмат). При программной реализации даже для недостаточно больших @n@ у вас, элементарно, не хватит места на HDD.\n\nСтоит также отметить, что каждый раз решать задачу о покрытии было бы не сильно эффективно, поэтому не плохо было бы прорешать все индивидуальные задачи о покрытии заранее, и сохранить их куда-нибудь. При переборе же МТ просто сравнивать результат работы машины с заранее известным результатом.\n\nВ принципе оказывается что и перебирать все МТ тоже не обязательно, ведь очевидно что многие МТ заранее будут давать неправильный результат. Отсеивать такие МТ можно используя различные эвристики.\n\nВ принципе и все @\\(^_^)/@\n\nВот оригинальный текст: \"проект.doc\":files/проект.doc\n',0,4,0,53,1384788840,1393341844),(21,'Семестровое задание','Семестровое задание','Семестровое задание','',4,'\"скачать\":files/semestr.pdf',1,2,0,152,1385465461,1385576395),(22,'Вопросы к экзамену','Вопросы к экзамену','Вопросы к экзамену','',4,'#(tasks) Множества (пустое множество,  подмножество, операции над множествами, парадокс Рассела, теорема о мощности булеана множества)\n# Отношения (свойства бинарных, эквивалентность отношений и функций)\n# Отношение эквивалентности (свойства, разбиение на классы эквивалентности)\n# Пропозициональные связки. Таблицы истинности. Формулы.\n# Тавтологии. Противоречия.\n# Полные системы связок (примеры полных систем состоящих из 2-х связок, из 1-ой связки)\n# Аксиоматическая теория L (определение, аксиомы)\n# Вывод в формулах исчисления высказываний (ФИВ).\n# Теорема дедукции в ФИВ.\n# Связь между тавтологиями и теоремами в ФИВ.\n# Формулы исчисления предикатов (кванторы, термы, формулы, свободные и связные переменные)\n# Интерпретации (область интерпретации, замкнутые формулы, свойства)\n# Теории первого порядка (аксиомы, собственные аксиомы, правила вывода)\n# Свойства теорий первого порядка.\n# Теорема дедукции в ФИП.\n# Лемма Линденбаума.\n# Связь между тавтологиями и теоремами в ФИП (Теорема полноты Геделя).\n# Машина Тьюринга. Функция сложности.\n# Классы задач по алгоритмической сложности.\n# Недетерминированные машины Тьюринга.\n# Теорема Кука.\n\n',1,3,0,330,1386941837,1386946968),(23,'','&#x25B2;','Чаинка','',11,'p=. Консультация по экзамену будет за день до экзамена. Точное время и место уточню позже.\n\n<hr>\n\nh1=. Начало экзамена в 12:00\n<hr>\n\n<!--\np={font-size:80%;color:gray;}. Чистики, не сдавшие лабораторные, подъезжайте со сделанными задачами в понедельник (13.01.2014) к 14:00 часам куда-нибудь к 122 аудитории, я там мимо пробегу.\n-->\n',0,1,0,0,1389374671,1389606735),(24,'','&#x25B2;','Чаинка','',11,'\nnotextile.. \n<style>\n#id_12345 {\n   text-align:center;\n}\n#id_12345 td, #id_12345 th {\n  padding: 0.6em;\n}\n</style>\n\n<hr>\n\nh1=. Начало экзамена в 12:00\n<hr>\n\n\n\np={font-size:100%;color:#002255;}. консультации:\n\nnotextile.. \n<table id=id_12345 align=center>\n\n		<tr>\n			<td >для чистиков</td>\n			<td>23.01.2014</td>\n			<td rowspan=\"2\">в 14:30</td>\n			<td>225 ауд.</td>\n			\n		</tr>\n		<tr>\n			<td>для всех остальных</td>			\n			<td>27.01.2014</td>\n			<td>328 ауд.</td>\n		</tr>\n</table>\n\np. \n',0,2,0,1,1389606516,1392044314),(25,'','&#x25B2;','Чаинка','',11,'\nnotextile.. \n<style>\n#id_12345 {\n   text-align:center;\nmargin-top:1em;\n}\n#id_12345 td, #id_12345 th {\n  padding: 0.6em;\n\n}\n</style>\n\n<hr>\n\nh1=. Начало экзамена в 12:00\n\nnotextile.. \n<table id=id_12345 align=center>\n<!--<tr> <th colspan=3>Консультация</th>\n</tr>-->\n		<tr>	\n			<td>консультация -></td>	\n			<td>27.01.2014</td>\n			<td>в 14:30</td>\n			<td>в 328 ауд.</td>\n		</tr>\n</table>\n<hr>\n\np. \n\n<div class=\"lab\"><h2 class=\"title\"><a>Как быстро завалить экзамен?</a></h2><div class=\"info\"> подойти ко мне не зная и не умея привести примеры:\n\n# \n# множества\n# декартова произведения\n# отношения\n# тавтологии и противоречия\n# правила вывода и трех аксиомы\n# функции сложности\n# машины Тьюринга\n</div></div>',0,3,0,0,1390640957,1390643090),(26,'Генерация изображений','Генерация изображений','Генерация изображений','',12,'\np(#toc).  \n\nРаботать будем в *Intellij IDEA 13 Community Edition*, скачать которую можно отсюда: \n\"http://www.jetbrains.com/idea/download/index.html\":http://www.jetbrains.com/idea/download/index.html\n\nОна бесплатна, с открытом кодом, и может быть использована вплоть до разработки коммерческих приложений (хотя для нас это совсем не важно @^_^@)\n\nСкачивание и установка не должно вызвать у вас ни каких проблем. \nО том как правильно настроить читайте \"тут\":http://www.tealeaf.su/index.php/page/12/31.\n<hr>\n\nВ этом уроке мы создадим простое приложение, которое будет генерировать изображение и позволит сохранять его в файл \n\nh2. Создание проекта\n\nЗапускаем *Intellij IDEA*: !(img-small)images/lessons/imagesprocessing/01/image0.png!\n\nЕсли вы первый раз запускаете *IDEA* и увидели окошко как на картинке ниже, то щелкайте *Create New Project*, иначе выбирайте  в меню *File / New Project*. !(img-small)images/lessons/imagesprocessing/01/image0_5.png!\n\n\nУкажим тип приложения *java*, и укажем в качестве имени проекта *ImageProcessing*. \nПотом кликнем *Next*.\n!(img-small)images/lessons/imagesprocessing/01/image1.png!\n\nНа следующей вкладке ничего не трогаем и просто нажимаем *Finish*\n!(img-small)images/lessons/imagesprocessing/01/image2.png!\n\nСоздадим пакет под интерфейс:\n!(img-small)images/lessons/imagesprocessing/01/image3.png!\n\nНазавем его *ui* (от *user interface* -- интерфейс пользователя), кликнем *ok*\n!(img-small)images/lessons/imagesprocessing/01/image4.png!\n\nТеперь добавим класс формы в пакет, для этого в дереве проекта кликаем правой кнопкой мыши на имя пакета (в нашем случае на *ui*)\n!(img-small)images/lessons/imagesprocessing/01/image6.png!\n\nНазовем нашу форму *MainFrame*, и кликнем *ok*\n!(img-small)images/lessons/imagesprocessing/01/image7.png!\n\nДолжны увидеть, что-то вроде этого:\n!(img-small)images/lessons/imagesprocessing/01/image8.png! <hr>\n\nh2. Редактирование формы\n\nКликнете куда-нибудь центр формы. Нажав где-нибудь в центре формы на самом деле мы выберем главную панель формы (на ней в последствии будут расположены остальные компоненты -- кнопки, изображения и т.д.)\nСлева в окне свойства пропишем имя (свойство *fieldName*) главной панели -- назовем ее *MainPanel*.\n!(img-small)images/lessons/imagesprocessing/01/image9.png!\n\nТеперь перетянем с правой панели (*Pallete*) на панель компоненту типа *JLabel*, будем использовать ее, чтобы выводить изображение.\nВажно чтобы при перетягивании компоненты граница панели подсвечивалась синей рамкой как на изображении (т.е. очерчивала всю область панели)\n!(img-small)images/lessons/imagesprocessing/01/image10.png!\n\nВыберем добавленную компоненту и установим ей следующие свойства \n\n* *fieldName* -- lblImage \n* *Horizontal Size Policy* -- Can Grow, Want Grow (развернуть узел и поставить соответствующие галочки)\n* *Vertical Size Policy* -- Can Grow, Want Grow (развернуть узел и поставить соответствующие галочки)\n* *Horizontal Align* -- Fill\n* *Vertical Align* -- Fill\n\n!(img-small)images/lessons/imagesprocessing/01/image12.png!\n\nТеперь перетянем на панелку кнопку *JButton*, перетянуть надо так, чтобы во время перетягивания подсветилась лишь верхняя граница формы;\n!(img-small)images/lessons/imagesprocessing/01/image13.png!\n\nЕсли все правильно сделали, то получим что-то в этом роде (не забудем поменять имя кнопки, поле *fieldName*, на *btnGenerate*):\n!(img-small)images/lessons/imagesprocessing/01/image14.png!\n\nС интерфейсом покончили, теперь можно приступить к написанию кода, для этого кликаем на левую (та что *MainFrame.java*) из двух вкладок:\n!(img-small)images/lessons/imagesprocessing/01/image15.png!\n\nУвидим следующий код, он сгенерирован автоматически и соответствует нашей форме:\n!(img-small)images/lessons/imagesprocessing/01/image16.png!\n\nЧтобы при запуске приложения, сразу открывалась наша форма, необходимо создать метод *main* в теле класс *MainFrame*. К счастью нет необходимости писать его вручную, *IDEA* очень \"умная\" среда и сделает это за нас. \n\nДля этого на любой свободной строке в теле класс, нажмите *Alt + Enter*. Выскочит небольшое окошко которое позволяет автоматически генерировать код; кликаем мышью по *Form main()*.\n!(img-small)images/lessons/imagesprocessing/01/image17.png!\n\nБудет автоматически сгенерирован метод *main* для формы.\n!(img-small)images/lessons/imagesprocessing/01/image18.png! <hr>\n\nh2. Настройка конфигурации запуска \n\nДля того чтобы можно было запускать приложение из *IDEA*, необходимо создать конфигурацию запуска. Для этого в главном меню выбираем пункт *Run / Edit Configurations*:\n!(img-small)images/lessons/imagesprocessing/01/image19.png!\n\nКликаем на плюсик в левом верхнем углу и выбираем *Application*:\n!(img-small)images/lessons/imagesprocessing/01/image20.png!\n\nМы добавили новую конфигурацию запуска, назовем ее *Desktop* (поле *Name*) и в качестве главного класса (поле *Main Class*) укажем класс *ui.MainFrame* (класс можно выбрать нажав на *...*). Нажимаем *Ok*\n!(img-small)images/lessons/imagesprocessing/01/image21.png!\n\nТеперь можно запустить приложение нажав *Shift + F10*. И посмотреть как выглядит наша форма в реальности. Правда пока она ничего не умеет делать, но мы скоро это поправим. Выглядеть она будет примерно так:\n!(img-small)images/lessons/imagesprocessing/01/image29.png!\n\nЕсли форма вам кажется слишком маленькой, то это дела поправимое. Перейдем в редактор формы (выберем правую из двух вкладок) !(img-small)images/lessons/imagesprocessing/01/image15.png! Чтобы немного увеличить в размерах нашу форму, кликнете на компоненту *lblImage* на форме. И настройте свойство *Prefferd Size* как на картинке: !(img-small)images/lessons/imagesprocessing/01/image30.png! Теперь если запустить приложение (*Shift + F10*) наше окошко будет иметь вполне приличные размеры: !(img-small)images/lessons/imagesprocessing/01/image31.png!\n\np(note). Если вам не нравиться что окошко появляется в левом верхнем углу, добавьте следующую строчку в метод *main* класса *MainFrame*: !(img-small)images/lessons/imagesprocessing/01/image32.png!\n\nnotextile. <span id=\"listener\"></span>\n\np. Пропишем обработчик события нажатия для кнопки *Сгенерировать*. Для этого в редакторе формы кликнем правой кнопкой мыши по кнопке и выберем *Create Listener*:\n!(img-small)images/lessons/imagesprocessing/01/image22.png!\n\nВо всплывшем меню выбираем *ActionListener*:\n!(img-small)images/lessons/imagesprocessing/01/image23.png!\n\nНас перебросят в редактор кода, здесь мы увидим автоматически сгенерированный анонимный класс типа *ActionListner*, который передается в метод *addActionListener* кнопки *btnGenerate*:\n!(img-small)images/lessons/imagesprocessing/01/image24.png!\n\nНе сдвигая печатающую каретку, нажимем *Alt + Enter*, во всплывшем мини-меню выбираем *Implement Methods* (щелчком мыши либо клавишей *Enter*)\n!(img-small)images/lessons/imagesprocessing/01/image25.png!\n\nВо всплывшем окне, просто щелкаем *ok*:\n!(img-small)images/lessons/imagesprocessing/01/image26.png!\n\nТеперь у нас есть тело функции, которая будет вызываться каждый раз при нажатии кнопки *Сгенерировать*.\n!(img-small)images/lessons/imagesprocessing/01/image27.png! <hr>\n\nh2. Генерация изображения\n\nПропишем обработчик события:\n\npre(brush:javafx).. \npublic void actionPerformed(ActionEvent e) {\n  // создаем изображение 300 на 300 пикселей, с одним каналом\n  BufferedImage image = new BufferedImage(300, 300, BufferedImage.TYPE_BYTE_GRAY);\n\n\n  // создаем объект для работы с пикселями\n  WritableRaster raster = image.getRaster();\n\n  // обходим каждый пиксель изображения\n  for (int y = 0; y < raster.getHeight(); ++y) { // строки\n      for (int x = 0; x < raster.getWidth(); ++x) { // столбцы\n          // проверяем номер строки / столбца на четность\n          if ( x % 2 == 0 || y % 2 == 0 ) {\n              // если да то меняем цвет пикселя на белый\n              raster.setSample(x, y, 0, 255);\n          } else {\n              // иначе на черный\n              raster.setSample(x, y, 0, 0);\n          }\n      }\n  }\n\n  // передаем изображение компоненте lblImage\n  // для отображения\n  lblImage.setIcon(new ImageIcon(image));\n}\n\np. Запустите приложение (*Shift + F10*) и нажмите кнопку *Сгенерировать*: !(img-small)images/lessons/imagesprocessing/01/image33.png!\n\nВот и все :D <hr>\n\nh2. Сохранение в файл\n\nВозможно вам захочется сохранить сей шедевр в файл, для этого добавим на форму дополнительную кнопку, назовем ее *btnSave* (поле *fieldName*): !(img-small)images/lessons/imagesprocessing/01/image35.gif!\n\nОтмечу, что к новой кнопке справа я добавляю компоненту *HSpacer*, делать это необязательно, но позволяет выравнять размеры кнопок по содержимому влево.\n\nДобавим обработчик события нажатия на кнопку *Сохранить* (правой кнопкой мыши по кнопке -> *Create Listener* -> *Action Listiner* -> *Alt + Enter* -> *Implement Methods* -> *Ok*)\n\nПропишем обработчик события:\n\npre(brush:javafx).. \n@Override\npublic void actionPerformed(ActionEvent e) {\n    // создаем диалог для выбора файла\n    JFileChooser chooser = new JFileChooser();\n\n    // создаем фильтр файлов (чтобы отображалист только файлы типа *.png\n    FileFilter filterPNG = new FileNameExtensionFilter(\"*.png\", \"png\");\n\n    // устанавливае фильтр\n    chooser.setFileFilter(filterPNG);\n\n    // показываем окно выбора файла и проверяем нажал ли пользователь кнопку согласия\n    if ( chooser.showSaveDialog(null) != JFileChooser.APPROVE_OPTION ) {\n        return;\n    }\n      \n    // создаем ссылку на выбранный файл\n    File file = chooser.getSelectedFile();\n\n    // если пользователь не преписал расширение файла, то допишем сами\n    if ( !filterPNG.accept(file) ) {\n        file = new File(file.getAbsolutePath() + \".png\");\n    }\n  \n    // создаем ссылку на изображение помещенное в компоненту lblImage\n    ImageIcon icon = (ImageIcon) lblImage.getIcon();\n\n    // таким хитрым способом сохраняем изображение в файл\n    // try -- используется для перехвата ошибок\n    try {\n        ImageIO.write( (RenderedImage) icon.getImage(), // изображение\n                       \"png\", // тип файла\n                       new FileOutputStream(file)); // поток вывода\n    } catch (IOException ex) {\n        ex.printStackTrace(); // если случиться ошибка то напечатаем стэк вызовов\n    }\n}\n\np. Ну теперь точно все -- можно генерировать и тут же сохранять изображение в файл.',1,5,0,50,1391879962,1392820571),(30,'Работа с каналами','Работа с каналами','Работа с каналами','',12,'\np(#toc).  \n \nСоздадим программу которая позволит нам открыть любую (ну почти любую) картинку из файла. Преобразовать ее из *RGB* в *Grayscale*, и нормализовать на промежутке *[0; 255]*.<hr>\n\nh2. Создание проекта \n\nСоздаем новый проект *File / New Project*\n!(img-small)images/lessons/imagesprocessing/02/image02.png!\nСоздаем новую форму:\n!(img-small)images/lessons/imagesprocessing/02/image03.png!\nНазываем ее *MainForm*\n!(img-small)images/lessons/imagesprocessing/02/image04.png!\nКак и в прошлый раз перетягиваем на форму компоненту *JLabel* И устанавливаем ей следующий свойства:\n!(img-small)images/lessons/imagesprocessing/02/image05.png!\nДобавляем кнопки \n!(img-small)images/lessons/imagesprocessing/02/image06.gif!\nНе особо важный момент, но кнопки я назвал следующим образом:\n* \"Открыть изображение\" -- свойство *fieldname*: btnOpen\n* \"RGB -> Gray\" -- свойство *fieldname*: btnConvert\n\n<hr>\n\nh2. Кнопка \"Открыть изображение\"\n\nПропишем обработчик нажатия на кнопку *btnOpen*. Для этого нажмем на кнопку правой кнопкой и выбирем *Create Listener*:\n!(img-small)images/lessons/imagesprocessing/02/image13.png!\n\nВыбираем *ActionListener*\n!(img-small)images/lessons/imagesprocessing/02/image14.png!\n\nНас перебросит в редактор кода, не сдвигая курсор, нажимаем *Alt + Enter*. Выбираем *Implement Methods*, кликая ЛКМ, либо нажимая Enter:\n!(img-small)images/lessons/imagesprocessing/02/image15.png!\n\nОткроется диалоговое окно, просто нажимаем *Ok*:\n!(img-small)images/lessons/imagesprocessing/02/image16.png!\n\nПрописываем обработчик события:\n\npre(brush:javafx).. \n\nbtnOpen.addActionListener(new ActionListener() {\n    @Override\n    public void actionPerformed(ActionEvent e) {\n        // создаем диологовое окно -- выбор файла\n        JFileChooser fileChooser = new JFileChooser();\n\n        // открываем окно и проверяем выбрал ли пользователь файл\n        if (fileChooser.showOpenDialog(null) != JFileChooser.APPROVE_OPTION) {\n            // если не выбрал то выходим из функции\n            return;\n        }\n\n        // создаем ссылку на объект выбранного файла\n        File file = fileChooser.getSelectedFile();\n\n        // создаем изображение из файла \n        // и устанавливаем в качестве текущего изображения lblImage\n        lblImage.setIcon(new ImageIcon(file.getAbsolutePath()));\n    }\n}); \n\np. <hr>\n\nh2. Конфигурация запуска\n\nДобавим метод *main* чтобы использовать класс *MainForm* в качестве входной точки приложения.\nНа любой пустой строке внутри класс *MainForm* нажимаем *Alt + Insert* (scroll lock должен быть отключен). В выскочившем меню выбираем *Form main()*:\n!(img-small)images/lessons/imagesprocessing/02/image17.png!\nЕсли все правильно сделали, то должно появиться что-то в этом роде:\n!(img-small)images/lessons/imagesprocessing/02/image18.png!\nТеперь добавим когфигурацию запуска *IDEA*. В меню выбираем *Run | Edit Configurations...*. Кликаем на зеленый плюсик в левом верхнем углу открывшегося диалогового окна. Выбираем *Application*. Настраиваем параметры как на картинке (т.е., по сути, указываем праметры *Name* и *Main class*), кликаем *Ok*:\n!(img-small)images/lessons/imagesprocessing/02/image19.png!\n <hr>\n\nh2. Кнопка \"RGB -> Gray\"\n\nПропишем обработчик события для кнопки *btnConvert*. Переключимся в редактор формы, кликнем на кнопку *RGB -> Gray* правой кнопкой мыши, выбирем *Create Listener*, далее *ActionListener*. Нас перебросят в редактор кода, не сдвигая курсор нажимаем *Alt + Enter*, нажимаем *Enter*, откроется диалоговое окно -- нажимаем *Ok*.\n\nТеперь можно прописать обработчик нажатия на кнопку:\n\npre(brush:javafx).. \n\nbtnConvert.addActionListener(new ActionListener() {\n    @Override\n    public void actionPerformed(ActionEvent e) {\n\n        // копируем изображение из изображения на форме\n        Icon icon = (Icon)lblImage.getIcon();\n        BufferedImage image = new BufferedImage(icon.getIconWidth(),\n                icon.getIconHeight(), BufferedImage.TYPE_INT_RGB);\n        Graphics g = image.getGraphics();\n        icon.paintIcon(null, g, 0, 0);\n        g.dispose();\n\n        // создаем объект для эффективного доступа к данным изображения\n        WritableRaster raster = image.getRaster();\n\n        for(int y=0;y<raster.getHeight();++y) {\n            for(int x=0;x<raster.getWidth();++x) {\n                // считываем все компоненты пикселя\n                int red = raster.getSample(x,y, 0);\n                int blue = raster.getSample(x,y, 1);\n                int green = raster.getSample(x,y, 2);\n\n                // формируем серый цвет, по формуле учитывающей особенности\n                // человеческого восприятия цвета\n                int gray = (red*11 + green * 16 + blue * 5) / 32;\n\n                // меняем значения пикселя на серый\n                raster.setPixel(x,y, // положения пикселя\n                        new int[]{gray, gray, gray} // значения трех компонент\n                        );\n            }\n        }\n\n        // теперь нормализуем значения\n        // сначала найдем минимальное и максимальное значения пикселей\n        int min = raster.getSample(0,0,0);\n        int max = raster.getSample(0,0,0);\n        for(int y=0;y<raster.getHeight();++y) {\n            for(int x=0;x<raster.getWidth();++x) {\n                int value = raster.getSample(x,y, 0);\n\n                if (value < min)\n                    min = value;\n\n                if (value > max)\n                    max = value;\n            }\n        }\n\n        // собственно нормализация значений\n        int range = max - min;\n        float kScale = 255.0f / range; // коэффициент растяжения\n        for(int y=0;y<raster.getHeight();++y) {\n            for(int x=0;x<raster.getWidth();++x) {\n                // текущее значения пикселя\n                int value = raster.getSample(x,y, 0);\n\n                // нормализованное значения пикселя\n                int normalizedValue = (int)(kScale * (value - min));\n\n                // меняем значения пикселя на нормализованное\n                raster.setPixel(x,y, // положения пикселя\n                        new int[]{normalizedValue, normalizedValue, normalizedValue}\n                );\n            }\n        }\n\n        // устанавилваем обработанное изображение в качетве текущего\n        lblImage.setIcon(new ImageIcon(image));\n    }\n});\n\np. В принципе задача решена. Изображения открываются, каналы пересчитываются.\n <hr>\n\nh2. JLabel с автомасштабируемым изображением.\n\nВозможно вам не нравиться поведение *JLabel* при достаточно больших изображениях. Изображение не влезает на экран. Рассмотрим как создать пользовательскую компоненту *JLabel* с масштабированием изображения по размеру *JLabel*.\n\nДобавим новый класс:\n!(img-small)images/lessons/imagesprocessing/02/image20.png!\nНазовем его *JLabelImage*, и кликнем *Ok*\n!(img-small)images/lessons/imagesprocessing/02/image21.png!\nПропишем следующий код:\n\npre(brush:javafx).. \nimport javax.imageio.ImageIO;\nimport javax.swing.*;\nimport java.awt.*;\nimport java.awt.image.BufferedImage;\nimport java.io.File;\nimport java.io.IOException;\n\n// JLabelImage расширяет функционал JLabel\npublic class JLabelImage extends JLabel {\n\n    /**\n     * внутренее изображение\n     */\n    BufferedImage image = null;\n\n    @Override\n    @SuppressWarnings(\"empty-statement\")\n    protected void paintComponent(Graphics g) {\n        // провереям что изображение установленно\n        if (image!=null) {\n            // рассчитываем отношения ширины к высоте изображения и высоты\n            float kImage = (float) image.getWidth() / image.getHeight();\n            float kLabel = (float) getWidth() / getHeight();\n            float k;\n            Point offset = new Point();\n\n            // рассчитываем коэффициенты растяжения\n            if (kImage < kLabel) {\n                k = (float) getHeight() / image.getHeight() ;\n                offset.x = (int) (getWidth() - image.getWidth()*k);\n            } else {\n                k = (float) getWidth() / image.getWidth() ;\n                offset.y = (int) (getHeight() - image.getHeight()*k);\n            }\n\n            // сдвигаем изображение в соотвтествии со свойством HorizontalAlignmen\n            switch(getHorizontalAlignment()) {\n                case SwingConstants.LEFT:\n                case SwingConstants.LEADING:\n                    offset.x = 0; break;\n                case SwingConstants.CENTER:\n                    offset.x /= 2; break;\n            }\n\n            // сдвигаем изображение в соотвтествии со свойством VerticalAlignment\n            switch(getVerticalAlignment()) {\n                case SwingConstants.TOP:\n                    offset.y = 0; break;\n                case SwingConstants.CENTER:\n                    offset.y /= 2; break;\n            }\n\n            // рисуем уменьшенное изображение\n            g.drawImage(image,\n                    offset.x,\n                    offset.y,\n                    offset.x + (int)(image.getWidth()*k),\n                    offset.y + (int)(image.getHeight()*k),\n                    0, 0, image.getWidth(), image.getHeight(),\n                    null);\n        }\n\n        // вызываем метод paintComponent класса родителя\n        super.paintComponent(g);\n    }\n\n    /**\n     * @return текущее изображение\n     */\n    public BufferedImage getImage() {\n        return image;\n    }\n\n    /**\n     * Устанавливает в качестве текущего изображения image\n     * @param image новое изображение\n     */\n    public void setImage(BufferedImage image) {\n        this.image = image;\n        // обновляем JLabel\n        updateUI();\n    }\n    /**\n     * Устанавливает в качестве текущего изображения изображение из файла\n     * @param path путь к изображению\n     */\n    public void setImage(String path)  {\n        try {\n            setImage(ImageIO.read(new File(path)));\n        } catch (IOException ex) {\n            ex.printStackTrace();\n        }\n    }\n}\n\np. Теперь переключимся в редактор формы. Нажмем правой кнопкой на *lblImage*. Выберем *Morph Component...*\n!(img-small)images/lessons/imagesprocessing/02/image22.png!\nВыбираем *Non-Pallete Component...*\n!(img-small)images/lessons/imagesprocessing/02/image23.png!\nПропишем имя ново-созданного класса, нажимаем *Ok*\n!(img-small)images/lessons/imagesprocessing/02/image24.png!\n\np(note). Если вы предпочитаете *NetBeans*, вам достаточно перетянуть файл класса на форму:\n!(img-small)images/lessons/imagesprocessing/02/image27.png!\n\nТеперь вместо компонента *JLabel* будет использоваться *JLabelImage*. Отредактируем ранее написанный код.\n\nОбработчик *btnOpen*:\n\npre(brush:javafx).. \n\nbtnOpen.addActionListener(new ActionListener() {\n    @Override\n    public void actionPerformed(ActionEvent e) {\n        // создаем диологовое окно -- выбор файла\n        JFileChooser fileChooser = new JFileChooser();\n\n        // открываем окно и проверяем выбрал ли пользователь файл\n        if (fileChooser.showOpenDialog(null) != JFileChooser.APPROVE_OPTION) {\n            // если не выбрал то выходим из функции\n            return;\n        }\n\n        // создаем ссылку на объект выбранного файла\n        File file = fileChooser.getSelectedFile();\n\n        // создаем изображение из файла \n        // и устанавливаем в качестве текущего изображения lblImage\n        // >> тут меняем строчку >>\n        lblImage.setImage(file.getAbsolutePath());\n    }\n}); \n\np. Обработчик *btnConvert*, меняем в самом начале и в самом конце:\n\npre(brush:javafx).. \n\nbtnConvert.addActionListener(new ActionListener() {\n    @Override\n    public void actionPerformed(ActionEvent e) {\n\n        // больше нет необходимости в копировании изображения\n        // используем прямую ссылку\n        BufferedImage image = lblImage.getImage();\n\n        // создаем объект для эффективного доступа к данным изображения\n        WritableRaster raster = image.getRaster();\n\n        ...\n        \n        // устанавилваем обработанное изображение в качетве текущего\n        // lblImage.setIcon(new ImageIcon(image)); << эту строчку коментируем\n        lblImage.updateUI();\n    }\n});\n\np. Теперь изображение будет подстравиваться под размеры формы:\n!(img-small)images/lessons/imagesprocessing/02/image28.png!\n!(img-small)images/lessons/imagesprocessing/02/image29.png!',1,7,0,14,1392214239,1392831194),(27,'Список лабораторных заданий','&nbsp;&#9679; Лабораторные','Список лабораторных заданий','',12,' <div class=\"lab\"><h2 class=\"title\"><a>#1. Генерация изображений</a></h2><div class=\"info\">Сгенерировать изображение с заданным узором. Реализовать масштабирование (произвольное от 2 до n раз) узора. Все операции должны быть низкоуровневыми, то есть вы имеет права за раз изменять значение только одного пикселя, никаких *drawRect* и прочего. В результате должен получиться объект изображения с заданной высотой и шириной и с каналами и т.п., который неплохо было бы (хотя и не обязательно) иметь возможность сохранить в файл (jpeg или png или bmp или во что-то еще).\n\nПример: !(img-small){margin-bottom:1em;border:none;}images/lessons/imagesprocessing/tasks/t1_sample.png!\n <hr>\n <div class=\"tasks\">\n <div class=\"gallery\">\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_05.png! <div class=\"label\">1</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_06.png! <div class=\"label\">2</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_07.png! <div class=\"label\">3</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_08.png! <div class=\"label\">4</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_09.png! <div class=\"label\">5</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_10.png! <div class=\"label\">6</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_11.png! <div class=\"label\">7</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_12.png! <div class=\"label\">8</div></div>\n <div class=\"item easy selected\"> !images/lessons/imagesprocessing/tasks/t1_13.png! <div class=\"label\">9</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_01.png! <div class=\"label\">10</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_02.png! <div class=\"label\">11</div></div>\n <div class=\"item easy\"> !images/lessons/imagesprocessing/tasks/t1_03.png! <div class=\"label\">12</div></div>\n </div>\n </div>\n </div>\n <div class=\"lab\"><h2 class=\"title\"><a>#2. Обработка каналов</a></h2><div class=\"info\"> Написать программу, которая позволяет открыть произвольное изображение и изменить значения каналов по следующим формулам. Для доступа и изменения значений каналов пикселей использовать функции *setSample* и *getSample*. Все каналы должны быть нормализованы на промежутке от [0;255]. Т.е., например для оттенка (Hue) необходимо сжать промежуток от [0;359] до [0;255] и т.д. и т.п.\n <ol class=\"tasks\">\n <li class=\"easy\">*RGB* в *BRG*\n <li class=\"easy\">*RGB* в *CMY*\n <li class=\"easy\">*RGB* в *BLR*\n <li class=\"easy\">*RGB* в *(|B-R|,|G-R|,|B-G|)*\n <li class=\"medium\">*RGB* в *HSV*\n <li class=\"medium\">*RGB* в *HSL*\n <li class=\"hard\">*RGB* в *min(R,G,B)* - *max(R,G,B)*, нормализовать значения таким образом чтобы максимальное значение среди всех пикселей изображения совпадало с *255*, а минимальное с 0.\n <li class=\"hard\">*RGB* в *L*, нормализовать значения таким образом чтобы максимальное значение *L* среди всех пикселей изображения совпадало с *255*, а минимальное с 0.\n <li class=\"hard\">*RGB* в *S ~hsl~*, нормализовать значения таким образом чтобы максимальное значение *S ~hsl~* среди всех пикселей изображения совпадало с *255*, а минимальное с 0.\n <li class=\"hard\">*RGB* в *S ~hsv~*, нормализовать значения таким образом чтобы максимальное значение *S ~hsv~* среди всех пикселей изображения совпадало с *255*, а минимальное с 0.\n </ol>\n </div>\n </div>',1,2,0,39,1391880009,1392815949),(31,'Настройка IDEA','Настройка IDEA','Настройка IDEA','',12,'*Intellij IDEA 13 Community Edition*, скачать можно отсюда: \n\"http://www.jetbrains.com/idea/download/index.html\":http://www.jetbrains.com/idea/download/index.html\n\nСкачиваем, устанавливаем.\n\nЧтобы она запустилась и правильно функционировала скачиваем *Java SDK*\n\"http://www.oracle.com/technetwork/java/javase/downloads/index.html\":http://www.oracle.com/technetwork/java/javase/downloads/index.html\n!(img-small)images/lessons/imagesprocessing/setup/Java1_.png! Ставим галочку на согласие с лицензионным соглашением, выбираем файл, соответствующий битности вашей системы. !(img-small)images/lessons/imagesprocessing/setup/Java2_.png!\n\nЗапускаем скачанный файл. Следуем инструкциям.<hr>\n\nh2. Для линксоидов\n\n<div class=\"note\"> Если вы линуксоид, то у вас процедура немного проще. Вот рецепт для *ubuntu-подобных* систем:\n\nДобавляем репозиторий\n\npre(brush:shell). sudo add-apt-repository ppa:webupd8team/java \n\nОбновляем информацию о пакетах: \n\npre(brush:shell). sudo apt-get update\n\nУстанавливаем *java 7*. Во время установки надо будет принять лицензионное соглашение:\n\npre(brush:shell). sudo apt-get install oracle-java7-installer\n\nПосле этого, убедимся что *java* действительно установилась:\n\npre(brush:shell). java -version \n\nДолжно \"вылезти\" что-нибудь в этом роде:\n\npre(brush:shell).. \njava version \"1.7.0_51\"\nJava(TM) SE Runtime Environment (build 1.7.0_51-b13)\nJava HotSpot(TM) 64-Bit Server VM (build 24.51-b03, mixed mode)\n\np. Если возникнет необходимость, можно менять установленные версии *java* используя следующую команду:\n\npre(brush:shell). sudo update-alternatives --config java\n\np. </div><hr>\n\nh2. Первый запуск. Настройка JDK\n\nПри первом запуске, во время создания первого проекта возможно придется указать путь к *Java SDK* (если в графе *Project SDK* стоит @<None>@).\n\nКликаем на *New...*, выбираем *JDK*\n!(img-small)images/lessons/imagesprocessing/setup/Java3_.png!\n\nУказываем путь к *Java SDK*, у меня было что-то в этом роде:\n!(img-small)images/lessons/imagesprocessing/setup/Java4.png!\n\n<div class=\"note\"> Если вы линуксоид, то у вас скорее всего все само подключится. В крайнем случае точно так же придется указать путь к *JDK*. Ну и помните *OpenJDK* для *IDEA* не подходит!</div>',1,4,0,11,1392818366,1392831121),(33,'Статьи','Статьи','Статьи','',12,'\np(#toc). \n <hr>\n\nh2. Полутона\n\n# \"Seven grayscale conversion algorithms (with pseudocode and VB6 source code)\":http://www.tannerhelland.com/3643/grayscale-image-algorithm-vb6/\n# \"How to Convert Temperature (K) to RGB: Algorithm and Sample Code\":http://www.tannerhelland.com/4435/convert-temperature-rgb-algorithm-code/\n\nh2. Дизеринг\n\n# \"Joel Yliluoma\'s arbitrary-palette positional dithering algorithm\":http://bisqwit.iki.fi/story/howto/dither/jy/\n# \"Image Dithering: Eleven Algorithms and Source Code\":http://www.tannerhelland.com/4660/dithering-eleven-algorithms-source-code/\n# \"Libcaca study: the science behind colour ASCII art \":http://caca.zoy.org/study/index.html\n\nh2. Фильтры\n\n# \"Real-time Diffuse (Spread) Image Filter in VB6\":http://www.tannerhelland.com/3601/realtime-diffuse-spread-image-filter-vb6/',0,3,0,0,1393058217,1393341870);
